(13, 1, '2015-04-12 01:37:27', '2015-04-12 01:37:27', 'These magical herbs are dark green in color. The leaves are oily and have a mint-like aroma.', 'Herb', '', 'publish', 'open', 'closed', '', 'herb', '', '', '2015-04-12 01:56:21', '2015-04-12 01:56:21', '', 0, 'http://192.168.1.134/meridian/?post_type=reagents&#038;p=13', 0, 'reagents', '', 0),
(14, 1, '2015-04-12 01:37:20', '2015-04-12 01:37:20', '', 'Reagent Information', '', 'publish', 'open', 'closed', '', 'acf_reagent-information', '', '', '2015-04-12 01:41:19', '2015-04-12 01:41:19', '', 0, 'http://192.168.1.134/meridian/?post_type=acf&#038;p=14', 0, 'acf', '', 0),
(15, 1, '2015-04-12 01:38:01', '2015-04-12 01:38:01', 'This sparkling green "Jasper emerald" is beautiful, although not exceptionally valuable. It has a warm, magical glow.', 'Emerald', '', 'publish', 'open', 'closed', '', 'emerald', '', '', '2015-05-17 04:26:53', '2015-05-17 04:26:53', '', 0, 'http://192.168.1.134/meridian/?post_type=reagents&#038;p=15', 0, 'reagents', '', 0),
(16, 1, '2015-04-12 01:38:37', '2015-04-12 01:38:37', 'This scale is hard as Jasper rock and as thick as a man''s finger. They seem to be the only remnants of the ancient Dragons that were thought to have gone extinct centuries ago.', 'Blue Dragon Scale', '', 'publish', 'open', 'closed', '', 'blue-dragon-scale', '', '', '2015-05-17 04:25:33', '2015-05-17 04:25:33', '', 0, 'http://192.168.1.134/meridian/?post_type=reagents&#038;p=16', 0, 'reagents', '', 0),
(17, 1, '2015-04-12 01:38:57', '2015-04-12 01:38:57', 'These magical mushrooms pulse with energy.', 'Blue Mushroom', '', 'publish', 'open', 'closed', '', 'blue-mushroom', '', '', '2015-05-17 04:25:52', '2015-05-17 04:25:52', '', 0, 'http://192.168.1.134/meridian/?post_type=reagents&#038;p=17', 0, 'reagents', '', 0),
(18, 1, '2015-04-12 01:39:46', '2015-04-12 01:39:46', 'These mushrooms are a common magical reagent.', 'Brown Mushroom', '', 'publish', 'open', 'closed', '', 'brown-mushroom', '', '', '2015-05-17 04:25:02', '2015-05-17 04:25:02', '', 0, 'http://192.168.1.134/meridian/?post_type=reagents&#038;p=18', 0, 'reagents', '', 0),
(19, 1, '2015-04-12 01:40:09', '2015-04-12 01:40:09', 'This feather, nearly a foot long, must have come from a truly awesome beast.', 'Dark Angel Feather', '', 'publish', 'open', 'closed', '', 'dark-angel-feather', '', '', '2015-05-17 04:25:59', '2015-05-17 04:25:59', '', 0, 'http://192.168.1.134/meridian/?post_type=reagents&#038;p=19', 0, 'reagents', '', 0),
(20, 1, '2015-04-12 01:40:22', '2015-04-12 01:40:22', 'Mined in dark and dangerous caves far below Jasper, this diamond is brilliant and valuable.', 'Diamond', '', 'publish', 'open', 'closed', '', 'diamond', '', '', '2015-05-17 04:26:12', '2015-05-17 04:26:12', '', 0, 'http://192.168.1.134/meridian/?post_type=reagents&#038;p=20', 0, 'reagents', '', 0),
(21, 1, '2015-04-12 01:40:39', '2015-04-12 01:40:39', 'Once belonging to a dragonfly, these eyes are uncommon, but much desired magical fare.', 'Dragonfly Eye', '', 'publish', 'open', 'closed', '', 'dragonfly-eye', '', '', '2015-05-17 04:26:19', '2015-05-17 04:26:19', '', 0, 'http://192.168.1.134/meridian/?post_type=reagents&#038;p=21', 0, 'reagents', '', 0),
(22, 1, '2015-04-12 01:41:02', '2015-04-12 01:41:02', 'These large, brownish mushrooms are an edible cousin of the magical variety. They provide some sustenance although their nutritional value is questionable.', 'Edible Mushroom', '', 'publish', 'open', 'closed', '', 'edible-mushroom', '', '', '2015-05-17 04:26:27', '2015-05-17 04:26:27', '', 0, 'http://192.168.1.134/meridian/?post_type=reagents&#038;p=22', 0, 'reagents', '', 0),
(23, 1, '2015-04-12 01:41:36', '2015-04-12 01:41:36', 'These magical herbs are rich and succulent. Bright red berries cling to tender branches.', 'Elderberry', '', 'publish', 'open', 'closed', '', 'elderberry', '', '', '2015-04-12 01:56:04', '2015-04-12 01:56:04', '', 0, 'http://192.168.1.134/meridian/?post_type=reagents&#038;p=23', 0, 'reagents', '', 0),
(24, 1, '2015-04-12 01:42:01', '2015-04-12 01:42:01', 'These ''berries'' are not actually berries at all, but rather dark yet colorful protrusions that sometimes grow from the roots of the living trees. Despite their name, they are bitter, chalky in texture, and ultimately inedible.', 'Entroot Berries', '', 'publish', 'open', 'closed', '', 'entroot-berries', '', '', '2015-04-12 01:44:47', '2015-04-12 01:44:47', '', 0, 'http://192.168.1.134/meridian/?post_type=reagents&#038;p=24', 0, 'reagents', '', 0),
