(63, 1, '2015-04-12 01:55:20', '2015-04-12 01:55:20', 'One of the world''s more ingenious carniverous plants, web moss captures small insects much as a spider web does, and then folds over on itself to devour it''s prey. Harvesting this substance is a dangerous and tedious process, but once the moss has dried, it can be invaluable for the casting of some spells.', 'Web Moss', '', 'publish', 'open', 'closed', '', 'web-moss', '', '', '2015-04-12 01:55:20', '2015-04-12 01:55:20', '', 0, 'http://192.168.1.134/meridian/?post_type=reagents&#038;p=63', 0, 'reagents', '', 0),
