(135, 1, '2015-04-12 16:53:06', '2015-04-12 16:53:06', 'Once thought to be a creature made up to frighten children, the black spider is said to be a product of evil sorcery, an unwholesome melding of human and insect. Its origin, however, is different depending on the story. In some, it is the fate of some poor soul who crossed a dark mage. In others, the dark spider is an evil mage transformed in return for longevity. All the old tales, however, warn travellers to beware of this malignant creature''s extraordinaryily poisonous bite.', 'Black Spider', '', 'publish', 'open', 'closed', '', 'black-spider', '', '', '2015-06-26 02:24:38', '2015-06-26 02:24:38', '', 0, 'http://192.168.1.134/meridian/?post_type=creatures&#038;p=135', 0, 'creatures', '', 0),
