(139, 1, '2015-04-24 22:57:11', '2015-04-24 22:57:11', 'The sight alone of this abomination of nature is often enough to paralyze a human. You shudder to think what dark ritual brought this creature into being.', 'Daemon Skeleton', '', 'publish', 'open', 'closed', '', 'daemon-skeleton', '', '', '2015-04-24 22:58:04', '2015-04-24 22:58:04', '', 0, 'http://192.168.1.134/meridian/?post_type=creatures&#038;p=139', 0, 'creatures', '', 0);
