(141, 1, '2015-04-24 22:59:00', '2015-04-24 22:59:00', 'Travelling under cover of darkness, the Dark Angels seek the souls of people to consume. They are pure evil, lashing out at any that wander near them. Surely these beasts are the handservants of Qor!', 'Dark Angel', '', 'publish', 'open', 'closed', '', 'dark-angel', '', '', '2015-04-24 22:59:00', '2015-04-24 22:59:00', '', 0, 'http://192.168.1.134/meridian/?post_type=creatures&#038;p=141', 0, 'creatures', '', 0),
(142, 1, '2015-04-24 22:58:19', '2015-04-24 22:58:19', '', 'creature_dark_angel', '', 'inherit', 'open', 'open', '', 'creature_dark_angel', '', '', '2015-04-24 22:58:19', '2015-04-24 22:58:19', '', 141, 'http://192.168.1.134/meridian/wp-content/uploads/2015/04/creature_dark_angel.png', 0, 'attachment', 'image/png', 0),
(143, 1, '2015-04-24 23:00:13', '2015-04-24 23:00:13', 'The air around the rat is dark and thick with evil. The smell of death and disease linger on its fetid breath as it darts towards its target. The origins of this abomination are unknown. The only definite knowledge known is of the deadly poison it carries in its bite.', 'Dusk Rat', '', 'publish', 'open', 'closed', '', 'dusk-rat', '', '', '2015-04-24 23:00:13', '2015-04-24 23:00:13', '', 0, 'http://192.168.1.134/meridian/?post_type=creatures&#038;p=143', 0, 'creatures', '', 0),
(144, 1, '2015-04-24 22:59:39', '2015-04-24 22:59:39', '', 'creature_dusk_rat', '', 'inherit', 'open', 'open', '', 'creature_dusk_rat', '', '', '2015-04-24 22:59:39', '2015-04-24 22:59:39', '', 143, 'http://192.168.1.134/meridian/wp-content/uploads/2015/04/creature_dusk_rat.png', 0, 'attachment', 'image/png', 0),
(145, 1, '2015-04-24 23:00:57', '2015-04-24 23:00:57', 'Dark, mischievious and ultimately malicious, these imps have but one goal-to bring the Qulicia wood into permanent darkness, so they can claim the Vale of Sorrows as their own. They hate their kinsmen, the fey elhai, with a fervent passion.', 'Fey Dirhai', '', 'publish', 'open', 'closed', '', 'fey-dirhai', '', '', '2015-04-24 23:01:06', '2015-04-24 23:01:06', '', 0, 'http://192.168.1.134/meridian/?post_type=creatures&#038;p=145', 0, 'creatures', '', 0),
(146, 1, '2015-04-24 23:00:44', '2015-04-24 23:00:44', '', 'creature_fey_dirhai', '', 'inherit', 'open', 'open', '', 'creature_fey_dirhai', '', '', '2015-04-24 23:00:44', '2015-04-24 23:00:44', '', 145, 'http://192.168.1.134/meridian/wp-content/uploads/2015/04/creature_fey_dirhai.png', 0, 'attachment', 'image/png', 0),
(147, 1, '2015-04-24 23:01:51', '2015-04-24 23:01:51', 'Lost souls of unending wrath, these fearsome undead are amongst the most feared creatures to walk the mainlands of Meridian. The torture and pain necessary to create one means that their occurance is relatively rare - which is a blessing for the living.', 'Ghost', '', 'publish', 'open', 'closed', '', 'ghost', '', '', '2015-04-24 23:01:51', '2015-04-24 23:01:51', '', 0, 'http://192.168.1.134/meridian/?post_type=creatures&#038;p=147', 0, 'creatures', '', 0),
(148, 1, '2015-04-24 23:01:23', '2015-04-24 23:01:23', '', 'creature_ghost_of_far_nohl', '', 'inherit', 'open', 'open', '', 'creature_ghost_of_far_nohl', '', '', '2015-04-24 23:01:23', '2015-04-24 23:01:23', '', 147, 'http://192.168.1.134/meridian/wp-content/uploads/2015/04/creature_ghost_of_far_nohl.png', 0, 'attachment', 'image/png', 0),
(149, 1, '2015-04-24 23:02:36', '2015-04-24 23:02:36', 'Rags and rotten flesh hang on the bones of this magical apparition. This is the ghost of a former tyrant of Meridian, Far''Nohl, who gave his life and soul to the dark arts.', 'Ghost of Far''Nohl', '', 'publish', 'open', 'closed', '', 'ghost-of-farnohl', '', '', '2015-04-24 23:02:36', '2015-04-24 23:02:36', '', 0, 'http://192.168.1.134/meridian/?post_type=creatures&#038;p=149', 0, 'creatures', '', 0),
(150, 1, '2015-04-24 23:03:10', '2015-04-24 23:03:10', 'The giant rat bares its yellow teeth in defiance. A smell of rot emanates from its filthy coat.', 'Giant Rat', '', 'publish', 'open', 'closed', '', 'giant-rat', '', '', '2015-04-24 23:03:10', '2015-04-24 23:03:10', '', 0, 'http://192.168.1.134/meridian/?post_type=creatures&#038;p=150', 0, 'creatures', '', 0),
