(152, 1, '2015-04-24 23:05:08', '2015-04-24 23:05:08', 'A younger form of its mature relatives, the larva is a bit weaker than other groundworms. It is known for its habit of lurking underground out of sight then suddenly springing forth to attack its victim.', 'Groundworm Larva', '', 'publish', 'open', 'closed', '', 'groundworm-larva', '', '', '2015-04-24 23:05:08', '2015-04-24 23:05:08', '', 0, 'http://192.168.1.134/meridian/?post_type=creatures&#038;p=152', 0, 'creatures', '', 0),
