(154, 1, '2015-04-24 23:06:25', '2015-04-24 23:06:25', 'The largest of the groundworms, the queen is a feared monster. After growing over long periods of time, groundworms need increasing amounts of food to sustain themselves. The queens are driven mad by an overwhelming desire to consume food to satiate their immense hunger. Occasionally groundworm queens lay eggs in corpses that hatch into groundworm larva.', 'Groundworm Queen', '', 'publish', 'open', 'closed', '', 'groundworm-queen', '', '', '2015-04-24 23:06:25', '2015-04-24 23:06:25', '', 0, 'http://192.168.1.134/meridian/?post_type=creatures&#038;p=154', 0, 'creatures', '', 0),
(155, 1, '2015-04-24 23:05:54', '2015-04-24 23:05:54', '', 'creature_groundworm_queen', '', 'inherit', 'open', 'open', '', 'creature_groundworm_queen', '', '', '2015-04-24 23:05:54', '2015-04-24 23:05:54', '', 154, 'http://192.168.1.134/meridian/wp-content/uploads/2015/04/creature_groundworm_queen.png', 0, 'attachment', 'image/png', 0),
(156, 1, '2015-04-24 23:07:07', '2015-04-24 23:07:07', 'Given the ominous task of guarding the heart of Zjiria, this stone troll glares darkly at all passerbyers. You have a feeling you better start running.<span class="Apple-converted-space">\r\n</span>', 'Guardian of Zjiria', '', 'publish', 'open', 'closed', '', 'guardian-of-zjiria', '', '', '2015-04-24 23:07:07', '2015-04-24 23:07:07', '', 0, 'http://192.168.1.134/meridian/?post_type=creatures&#038;p=156', 0, 'creatures', '', 0),
