(158, 1, '2015-04-24 23:07:42', '2015-04-24 23:07:42', 'This is a creature made completely from frozen water!', 'Ice Creature', '', 'publish', 'open', 'closed', '', 'ice-creature', '', '', '2015-04-24 23:07:42', '2015-04-24 23:07:42', '', 0, 'http://192.168.1.134/meridian/?post_type=creatures&#038;p=158', 0, 'creatures', '', 0),
(159, 1, '2015-04-24 23:08:18', '2015-04-24 23:08:18', 'This spindly-legged creature scuttles along the jungle canopy in search of unsuspecting prey, which includes just about everything that moves. Island travelers are warned to keep careful watch above, for the deadly grinning lizards have been known to decapitate a grown man in a single blow with their dagger sharp claws.', 'Kriipa', '', 'publish', 'open', 'closed', '', 'kriipa', '', '', '2015-04-24 23:08:18', '2015-04-24 23:08:18', '', 0, 'http://192.168.1.134/meridian/?post_type=creatures&#038;p=159', 0, 'creatures', '', 0),
