(165, 1, '2015-04-24 23:10:30', '2015-04-24 23:10:30', 'The exoskeleton of the mutant ant is thick and hard and its mandibles sharp and deadly. It is stronger and more vicious than its dark skinned cousin.<span class="Apple-converted-space">\r\n</span>', 'Mutant Ant', '', 'publish', 'open', 'closed', '', 'mutant-ant', '', '', '2015-04-24 23:10:30', '2015-04-24 23:10:30', '', 0, 'http://192.168.1.134/meridian/?post_type=creatures&#038;p=165', 0, 'creatures', '', 0),
