(169, 1, '2015-04-24 23:11:41', '2015-04-24 23:11:41', 'In order to gain the ominous title and station of Pit Boss, this orc had to battle and slay over one hundred other of its kind. In the caves, there is no more formidable warrior, determined leader or grisly adversary than the horrendous Pit Bosses.<span class="Apple-converted-space">\r\n</span>', 'Orc Pit Boss', '', 'publish', 'open', 'closed', '', 'orc-pit-boss', '', '', '2015-04-24 23:11:41', '2015-04-24 23:11:41', '', 0, 'http://192.168.1.134/meridian/?post_type=creatures&#038;p=169', 0, 'creatures', '', 0),
(170, 1, '2015-04-24 23:11:28', '2015-04-24 23:11:28', '', 'creature_orc_pit_boss', '', 'inherit', 'open', 'open', '', 'creature_orc_pit_boss', '', '', '2015-04-24 23:11:28', '2015-04-24 23:11:28', '', 169, 'http://192.168.1.134/meridian/wp-content/uploads/2015/04/creature_orc_pit_boss.png', 0, 'attachment', 'image/png', 0),
(171, 1, '2015-04-24 23:12:28', '2015-04-24 23:12:28', 'Harnessing dark powers from deep underground, the Orc Wizards enforce the mandates of their chieftain, such as extermination of the enemy shadow beasts. How the orcs came upon the powers of magic is unknown, but the thought of man''s greatest enemy armed with arcane power is enough to make any warrior queasy.<span class="Apple-converted-space">\r\n</span>', 'Orc Wizard', '', 'publish', 'open', 'closed', '', 'orc-wizard', '', '', '2015-04-24 23:12:28', '2015-04-24 23:12:28', '', 0, 'http://192.168.1.134/meridian/?post_type=creatures&#038;p=171', 0, 'creatures', '', 0),
(172, 1, '2015-04-24 23:12:04', '2015-04-24 23:12:04', '', 'creature_orc_wizard', '', 'inherit', 'open', 'open', '', 'creature_orc_wizard', '', '', '2015-04-24 23:12:04', '2015-04-24 23:12:04', '', 171, 'http://192.168.1.134/meridian/wp-content/uploads/2015/04/creature_orc_wizard.png', 0, 'attachment', 'image/png', 0),
(173, 1, '2015-04-24 23:13:06', '2015-04-24 23:13:06', 'The huge egg sack of the queen spider makes her slow and heavy, but dark intelligence shines in her many black eyes.', 'Queen Spider', '', 'publish', 'open', 'closed', '', 'queen-spider', '', '', '2015-04-24 23:13:06', '2015-04-24 23:13:06', '', 0, 'http://192.168.1.134/meridian/?post_type=creatures&#038;p=173', 0, 'creatures', '', 0),
(174, 1, '2015-04-24 23:12:48', '2015-04-24 23:12:48', '', 'creature_queen_spider', '', 'inherit', 'open', 'open', '', 'creature_queen_spider', '', '', '2015-04-24 23:12:48', '2015-04-24 23:12:48', '', 173, 'http://192.168.1.134/meridian/wp-content/uploads/2015/04/creature_queen_spider.png', 0, 'attachment', 'image/png', 0),
(175, 1, '2015-04-24 23:13:55', '2015-04-24 23:13:55', 'A noble woman of stunning beauty, Queen Venya''cyr carries herself with a refined demeanor hardly still seen in this day and age. You can''t help but marvel at how she has managed to keep her beautiful face so young and vibrant through all of these centuries.', 'Queen Venya''cyr', '', 'publish', 'open', 'closed', '', 'queen-venyacyr', '', '', '2015-04-24 23:13:55', '2015-04-24 23:13:55', '', 0, 'http://192.168.1.134/meridian/?post_type=creatures&#038;p=175', 0, 'creatures', '', 0),
(176, 1, '2015-04-24 23:13:36', '2015-04-24 23:13:36', '', 'creature_queen_venya_cyr', '', 'inherit', 'open', 'open', '', 'creature_queen_venya_cyr', '', '', '2015-04-24 23:13:36', '2015-04-24 23:13:36', '', 175, 'http://192.168.1.134/meridian/wp-content/uploads/2015/04/creature_queen_venya_cyr.png', 0, 'attachment', 'image/png', 0),
(177, 1, '2015-04-24 23:14:47', '2015-04-24 23:14:47', 'This evil being has been brought to life by dark magics of unknown origin. Its flesh is putrid and soft, and its eyes ask for rest from its cursed unlife. This creature has been inflicted with a permanent shadow curse, which gives it great strength but also great misery.<span class="Apple-converted-space">\r\n</span>', 'Shadow Mummy', '', 'publish', 'open', 'closed', '', 'shadow-mummy', '', '', '2015-04-24 23:14:47', '2015-04-24 23:14:47', '', 0, 'http://192.168.1.134/meridian/?post_type=creatures&#038;p=177', 0, 'creatures', '', 0),
(178, 1, '2015-04-24 23:14:33', '2015-04-24 23:14:33', '', 'creature_shadow_mummy', '', 'inherit', 'open', 'open', '', 'creature_shadow_mummy', '', '', '2015-04-24 23:14:33', '2015-04-24 23:14:33', '', 177, 'http://192.168.1.134/meridian/wp-content/uploads/2015/04/creature_shadow_mummy.png', 0, 'attachment', 'image/png', 0),
(179, 1, '2015-04-24 23:15:21', '2015-04-24 23:15:21', 'A magical abomination that hybrids the jungle kriipa with some quasi-substantial entity from the nether world. Residual Qor magic seems to make the air darker when this foul beast is near. Although they mainly prey on cave orcs, the shadowbeast have been known to kill humans on occasion.<span class="Apple-converted-space">\r\n</span>', 'Shadowbeast', '', 'publish', 'open', 'closed', '', 'shadowbeast', '', '', '2015-04-24 23:15:21', '2015-04-24 23:15:21', '', 0, 'http://192.168.1.134/meridian/?post_type=creatures&#038;p=179', 0, 'creatures', '', 0),
(180, 1, '2015-04-24 23:15:09', '2015-04-24 23:15:09', '', 'creature_shadowbeast', '', 'inherit', 'open', 'open', '', 'creature_shadowbeast', '', '', '2015-04-24 23:15:09', '2015-04-24 23:15:09', '', 179, 'http://192.168.1.134/meridian/wp-content/uploads/2015/04/creature_shadowbeast.png', 0, 'attachment', 'image/png', 0),
