(183, 1, '2015-04-24 23:16:45', '2015-04-24 23:16:45', 'This is the ice-born cousin of the mainland vermin. It is less disgusting by nature, but by far a more challenging foe.', 'Snow Rat', '', 'publish', 'open', 'closed', '', 'snow-rat', '', '', '2015-04-24 23:16:45', '2015-04-24 23:16:45', '', 0, 'http://192.168.1.134/meridian/?post_type=creatures&#038;p=183', 0, 'creatures', '', 0),
