(185, 1, '2015-04-24 23:17:15', '2015-04-24 23:17:15', 'This poor creature was once a person who was mummified in an ancient ritual and put to rest in the crypt. Ages have passed and only the spirit of the orignial person remains. It has been dead and mummified for so long it has forgotten what it originally looked like and now wanders this plane as a spectral being, appearing as it did when it was originally put to rest.', 'Spectral Mummy', '', 'publish', 'open', 'closed', '', 'spectral-mummy', '', '', '2015-04-24 23:17:15', '2015-04-24 23:17:15', '', 0, 'http://192.168.1.134/meridian/?post_type=creatures&#038;p=185', 0, 'creatures', '', 0),
