(266, 1, '2015-05-09 19:10:08', '2015-05-09 19:10:08', '<span style="font-family: Verdana,Arial,Helvetica; font-size: small;">Dedicated to preserving the ancient ways of the bone faction, this clan leader is feared for its keen accuracy with a bow and deadly slasher. </span>', 'Avar Leader', '', 'publish', 'open', 'closed', '', 'avar-leader', '', '', '2015-06-26 02:09:10', '2015-06-26 02:09:10', '', 0, 'http://192.168.1.134/meridian/?post_type=creatures&#038;p=266', 0, 'creatures', '', 0),
(267, 1, '2015-05-09 19:11:08', '2015-05-09 19:11:08', '<span style="font-family: Verdana,Arial,Helvetica; font-size: small;">Bright orange plates make up the exoskeleton of this giant centipede. Instinct, not intellect, guides it''s quest for human nourishment.</span>', 'Centipede', '', 'publish', 'open', 'closed', '', 'centipede', '', '', '2015-05-17 04:45:55', '2015-05-17 04:45:55', '', 0, 'http://192.168.1.134/meridian/?post_type=creatures&#038;p=267', 0, 'creatures', '', 0),
(268, 1, '2015-05-09 19:12:08', '2015-05-09 19:12:08', '<span style="font-family: Verdana,Arial,Helvetica; font-size: small;">Fierce warriors, these flightless bird men demand caution as you approach. The plumage clearly denotes this Avar as being part of the savage Kyip-Kyip-Kreeet tribe. </span>', 'Avar Warrior', '', 'publish', 'open', 'closed', '', 'avar-warrior', '', '', '2015-06-26 02:12:29', '2015-06-26 02:12:29', '', 0, 'http://192.168.1.134/meridian/?post_type=creatures&#038;p=268', 0, 'creatures', '', 0),
