(277, 1, '2015-05-16 02:29:41', '2015-05-16 02:29:41', 'Before you is a Xeochicatl, a fearsome monster given life by the chaotic mage of the Meridian. The Xeochicatl is the embodiment of destruction, a violent monster that seems uncontrollable. These monsters feed off of the magic of the lands which makes them very powerful. Rumors abound about the origin of these monsters, but you have little time to contemplate these rumors in the presence of such destructive power!', 'Xeochicatl', '', 'publish', 'open', 'closed', '', 'xeochicatl', '', '', '2015-05-17 04:45:35', '2015-05-17 04:45:35', '', 0, 'http://192.168.1.134/meridian/?post_type=creatures&#038;p=277', 0, 'creatures', '', 0),
(278, 1, '2015-05-16 02:30:11', '2015-05-16 02:30:11', 'The ancient King of the Lupoggs lords over these dark caves, knowing no creature to be its equal. The rock walls rumble and shake whenever this monstrosity wails. You feel as though you have already outlived most people who encounter the Lupogg King, but that thought does not comfort you any.', 'Lupogg King', '', 'publish', 'open', 'closed', '', 'lupogg-king', '', '', '2015-05-17 04:45:27', '2015-05-17 04:45:27', '', 0, 'http://192.168.1.134/meridian/?post_type=creatures&#038;p=278', 0, 'creatures', '', 0),
(279, 1, '2015-05-16 02:30:30', '2015-05-16 02:30:30', 'A mass of quivering goo, the slime inches forward leaving a sickly trail behind. The remains of its last victim are visible within its transparent innards.', 'Slime', '', 'publish', 'open', 'closed', '', 'slime', '', '', '2015-05-17 04:45:18', '2015-05-17 04:45:18', '', 0, 'http://192.168.1.134/meridian/?post_type=creatures&#038;p=279', 0, 'creatures', '', 0),
(280, 1, '2015-05-16 02:30:49', '2015-05-16 02:30:49', 'This magnificent white beast towers above all in his presence. Yetis are extremely dangerous, particularly when attacked in the ice caves where they dwell. Only a madman would dare attack a yeti alone.<span class="Apple-converted-space">\r\n</span>', 'Yeti', '', 'publish', 'open', 'closed', '', 'yeti', '', '', '2015-05-17 04:44:59', '2015-05-17 04:44:59', '', 0, 'http://192.168.1.134/meridian/?post_type=creatures&#038;p=280', 0, 'creatures', '', 0);
