(281, 1, '2015-05-16 02:31:31', '2015-05-16 02:31:31', 'These small lizards look exceptionally friendly. Their gossamer wings allow them to jump into the air and take flight for brief periods of time. When backed into a corner, dragonflies are known to have a nasty spitting attack.<span class="Apple-converted-space">\r\n</span>', 'Dragonfly', '', 'publish', 'open', 'closed', '', 'dragonfly', '', '', '2015-05-17 04:44:51', '2015-05-17 04:44:51', '', 0, 'http://192.168.1.134/meridian/?post_type=creatures&#038;p=281', 0, 'creatures', '', 0),
(282, 1, '2015-05-16 02:32:01', '2015-05-16 02:32:01', 'The other dragonflies seem to revere this oddly colored female. She looks up at you out of curiosity or hunger, you are not sure which.<span class="Apple-converted-space">\r\n</span>', 'Dragonfly Queen', '', 'publish', 'open', 'closed', '', 'dragonfly-queen', '', '', '2015-05-17 04:44:42', '2015-05-17 04:44:42', '', 0, 'http://192.168.1.134/meridian/?post_type=creatures&#038;p=282', 0, 'creatures', '', 0),
(283, 1, '2015-05-16 02:32:34', '2015-05-16 02:32:34', 'One of the noble woodland fairies, the fey elhai are most reknown for their utter hatred of their dark brothers, the fey dirhai.<span class="Apple-converted-space">\r\n</span>', 'Fey Elhai', '', 'publish', 'open', 'closed', '', 'fey-elhai', '', '', '2015-05-17 04:44:35', '2015-05-17 04:44:35', '', 0, 'http://192.168.1.134/meridian/?post_type=creatures&#038;p=283', 0, 'creatures', '', 0),
(284, 1, '2015-05-16 02:33:03', '2015-05-16 02:33:03', 'This is a frogman, a gentle race of amphibioids. They are known for their hatred of those who follow the evil path.', 'Frogman', '', 'publish', 'open', 'closed', '', 'frogman', '', '', '2015-05-17 04:44:28', '2015-05-17 04:44:28', '', 0, 'http://192.168.1.134/meridian/?post_type=creatures&#038;p=284', 0, 'creatures', '', 0),
(285, 1, '2015-05-16 02:33:31', '2015-05-16 02:33:31', 'This strange creature, made up of tender, pulpy flesh, moves slowly and deliberately. Giant spores cling to its back.<span class="Apple-converted-space">\r\n</span>', 'Fungus Beast', '', 'publish', 'open', 'closed', '', 'fungus-beast', '', '', '2015-05-17 04:44:20', '2015-05-17 04:44:20', '', 0, 'http://192.168.1.134/meridian/?post_type=creatures&#038;p=285', 0, 'creatures', '', 0),
(286, 1, '2015-05-16 02:33:56', '2015-05-16 02:33:56', 'The scorpion''s deadly stinger rises high in the air and its hard plated body protects it from all but the strongest attacks.', 'Giant Scorpion', '', 'publish', 'open', 'closed', '', 'giant-scorpion', '', '', '2015-05-17 04:43:27', '2015-05-17 04:43:27', '', 0, 'http://192.168.1.134/meridian/?post_type=creatures&#038;p=286', 0, 'creatures', '', 0),
(287, 1, '2015-05-16 02:34:43', '2015-05-16 02:34:43', 'A fearsome and stealthy creature, the groundworm is known for its habit of lurking underground out of sight, then suddenly springing forth to devour its hapless victim.', 'Groundworm', '', 'publish', 'open', 'closed', '', 'groundworm', '', '', '2015-05-17 04:43:19', '2015-05-17 04:43:19', '', 0, 'http://192.168.1.134/meridian/?post_type=creatures&#038;p=287', 0, 'creatures', '', 0),
(288, 1, '2015-05-16 02:35:18', '2015-05-16 02:35:18', 'Known for their brutal instincts, the Kyip-Kyip-Kreeet tribe relentlessly lords over the northwestern shores of the island. This clan leader is feared for its keen accuracy with a bow and deadly slasher.<span class="Apple-converted-space">\r\n</span>', 'Avar Chieftain', '', 'publish', 'open', 'closed', '', 'avar-chieftain', '', '', '2015-06-26 02:07:57', '2015-06-26 02:07:57', '', 0, 'http://192.168.1.134/meridian/?post_type=creatures&#038;p=288', 0, 'creatures', '', 0),
(289, 1, '2015-05-16 02:36:15', '2015-05-16 02:36:15', 'Legend says that the Shaman Avar blind themselves in order to force their third, ''magical'' eye to sprout forth. Only a fool would willing offend one of the fearsome warlocks.<span class="Apple-converted-space">\r\n</span>', 'Avar Shaman', '', 'publish', 'open', 'closed', '', 'avar-shaman', '', '', '2015-06-26 02:10:38', '2015-06-26 02:10:38', '', 0, 'http://192.168.1.134/meridian/?post_type=creatures&#038;p=289', 0, 'creatures', '', 0),
(290, 1, '2015-05-16 02:36:51', '2015-05-16 02:36:51', 'A primordial spirit flows through the dark branches of this ancient being. A forest scent of aged wood and fertile earth tingles your nostrils. You wonder if the story that it can summon lightning bolts to protect the forest is really true.<span class="Apple-converted-space">\r\n</span>', 'Living Tree', '', 'publish', 'open', 'closed', '', 'living-tree', '', '', '2015-05-17 04:42:53', '2015-05-17 04:42:53', '', 0, 'http://192.168.1.134/meridian/?post_type=creatures&#038;p=290', 0, 'creatures', '', 0),
(291, 1, '2015-05-16 02:37:20', '2015-05-16 02:37:20', 'This underwater denizen, although hideous and brutish, is rumored to be peaceful in nature, but there is no evidence of that now. The lupoggs seem upset that their territory has been trespassed upon, and seem eager to challenge any they can find.', 'Lupogg', '', 'publish', 'open', 'closed', '', 'lupogg', '', '', '2015-05-17 04:42:44', '2015-05-17 04:42:44', '', 0, 'http://192.168.1.134/meridian/?post_type=creatures&#038;p=291', 0, 'creatures', '', 0),
(292, 1, '2015-05-16 02:38:28', '2015-05-16 02:38:28', 'A recent arrival to the lands, this giant creature is rather peaceful. It roams the area, looking for food. It rarely attacks people unless it is attacked first. But, be warned, its thick shell and powerful claw make it a tough foe to face.', 'Mollusk Creature', '', 'publish', 'open', 'closed', '', 'mollusk-creature', '', '', '2015-05-17 04:42:35', '2015-05-17 04:42:35', '', 0, 'http://192.168.1.134/meridian/?post_type=creatures&#038;p=292', 0, 'creatures', '', 0),
(293, 1, '2015-05-16 18:45:19', '2015-05-16 18:45:19', 'Not your typical Royal bureaucrat. She''s attractive, charming, and by all accounts, honorable. Caramo has spent years counting the Duke''s money, filing the former Queen''s taxation scrolls, and more recently, serving as clerk for the Office of the Justicar.', 'Caramo', '', 'publish', 'open', 'closed', '', 'caramo', '', '', '2015-05-17 21:04:16', '2015-05-17 21:04:16', '', 0, 'http://192.168.1.134/meridian/?post_type=npcs&#038;p=293', 0, 'npcs', '', 0),
