(410, 1, '2015-05-16 18:50:24', '2015-05-16 18:50:24', 'Though well renown throughout the land for his superb skill as a master weapon smith, Fehr’loi Qan himself could not be considered the sharpest sword on the rack. The large man’s slow speech seems out of place in the high brow city of Barloque. You get the impression that he is uncomfortable with strangers, but his great size and clear devotion to Kraanan makes him afraid of no one.', 'Fehr''loi Quan', '', 'publish', 'open', 'closed', '', 'fehrloi-quan', '', '', '2015-05-17 21:08:55', '2015-05-17 21:08:55', '', 0, 'http://192.168.1.134/meridian/?post_type=npcs&#038;p=410', 0, 'npcs', '', 0),
(411, 1, '2015-05-16 18:51:12', '2015-05-16 18:51:12', 'Before you stands the stately guild hall executor. Frular has made a healthy profit off of selling official guild titles, maintenance of their charters and the leasing of guild halls.', 'Frular', '', 'publish', 'open', 'closed', '', 'frular', '', '', '2015-05-17 21:09:43', '2015-05-17 21:09:43', '', 0, 'http://192.168.1.134/meridian/?post_type=npcs&#038;p=411', 0, 'npcs', '', 0),
(412, 1, '2015-05-16 18:53:08', '2015-05-16 18:53:08', 'Fancying himself a connoisseur of the finer things, Herbutte is little more than a old school aristocratic snob. Within him is a dark streak of contempt for nearly all save royalty. He will never run out of bad things to say about the other towns and the low life transients that wander between them.', 'Herbutte', '', 'publish', 'open', 'closed', '', 'herbutte', '', '', '2015-05-17 21:10:42', '2015-05-17 21:10:42', '', 0, 'http://192.168.1.134/meridian/?post_type=npcs&#038;p=412', 0, 'npcs', '', 0),
(413, 1, '2015-05-16 18:54:06', '2015-05-16 18:54:06', 'Whistling an inane tune to himself, Joguer takes great care in tending to his fresh garden of magical herbs and mushrooms. Many say he is the foremost herbalist in the land.', 'Joguer', '', 'publish', 'open', 'closed', '', 'joguer', '', '', '2015-05-17 21:15:24', '2015-05-17 21:15:24', '', 0, 'http://192.168.1.134/meridian/?post_type=npcs&#038;p=413', 0, 'npcs', '', 0),
(414, 1, '2015-05-16 18:54:54', '2015-05-16 18:54:54', 'At one time Meidei only served the rich or those who tipped well, until recently when he "found" Shal’ille. Now a hard core believer, he almost drives his own customers away from his ale.', 'Meidei', '', 'publish', 'open', 'closed', '', 'meidei', '', '', '2015-05-17 21:18:08', '2015-05-17 21:18:08', '', 0, 'http://192.168.1.134/meridian/?post_type=npcs&#038;p=414', 0, 'npcs', '', 0),
(415, 1, '2015-05-16 18:55:18', '2015-05-16 18:55:18', 'Obert is a relatively handsome gentleman who takes almost as much pride in his vaults as he does in his family. His professional manner shows that he realizes his customers are often in a hurry to retrieve their goods.', 'Obert Cair''bre', '', 'publish', 'open', 'closed', '', 'obert-cairbre', '', '', '2015-05-17 21:19:46', '2015-05-17 21:19:46', '', 0, 'http://192.168.1.134/meridian/?post_type=npcs&#038;p=415', 0, 'npcs', '', 0),
(416, 1, '2015-05-16 18:55:54', '2015-05-16 18:55:54', 'Of everyone in Barloque, the former sailor turned innkeeper Pritchett is the least haughty. Perhaps it is because he was not from the Royal City and recently moved to North Barloque to buy a title.', 'Pritchett', '', 'publish', 'open', 'closed', '', 'pritchett', '', '', '2015-05-17 21:24:46', '2015-05-17 21:24:46', '', 0, 'http://192.168.1.134/meridian/?post_type=npcs&#038;p=416', 0, 'npcs', '', 0),
(417, 1, '2015-05-16 18:56:21', '2015-05-16 18:56:21', 'There is a malevolent, otherworldly quality to this man. He clings to the shadows of this vile place, a servant to some dark power.<span class="Apple-converted-space">\r\n</span>', 'Roq', '', 'publish', 'open', 'closed', '', 'roq', '', '', '2015-05-17 21:28:08', '2015-05-17 21:28:08', '', 0, 'http://192.168.1.134/meridian/?post_type=npcs&#038;p=417', 0, 'npcs', '', 0),
(418, 1, '2015-05-16 18:58:36', '2015-05-16 18:58:36', 'Used to working with the well refined tastes of nobility, Madelia meticulously oversees her craft. However, she often wishes to spend excessive time working on a single outfit for one of the more powerful and esteemed members of court. Madelia’s other hobby is to play with the hearts of men and currently has several affairs in the works.', 'Madelia', '', 'publish', 'open', 'closed', '', 'madelia', '', '', '2015-05-17 21:17:25', '2015-05-17 21:17:25', '', 0, 'http://192.168.1.134/meridian/?post_type=npcs&#038;p=418', 0, 'npcs', '', 0),
(419, 1, '2015-05-16 18:59:07', '2015-05-16 18:59:07', 'Graceful and good hearted, she has many loyal followers.', 'Princess Kateriina', '', 'publish', 'open', 'closed', '', 'princess-kateriina', '', '', '2015-05-16 19:00:14', '2015-05-16 19:00:14', '', 0, 'http://192.168.1.134/meridian/?post_type=npcs&#038;p=419', 0, 'npcs', '', 0),
(421, 1, '2015-05-16 19:01:21', '2015-05-16 19:01:21', 'A noble women of stunning beauty, Queen Venya''cyr carries herself with a refined demeanor hardly still seen in this day and age. You can''t help but marvel at how she has managed to keep her beautiful face so young and vibrant through all of these centuries.', 'Queen Venya''cyr', '', 'publish', 'open', 'closed', '', 'queen-venyacyr', '', '', '2015-05-17 21:25:33', '2015-05-17 21:25:33', '', 0, 'http://192.168.1.134/meridian/?post_type=npcs&#038;p=421', 0, 'npcs', '', 0),
(422, 1, '2015-05-16 19:01:54', '2015-05-16 19:01:54', 'As a mortal man Goad betrayed his Queen, sending her to her death. To his dismay, she was only temporarily inconvenienced and now she has bound him here, to serve for all eternity. His twisted form writhes in constant agony, relieved only briefly by the wash of ecstacy he feels when he oversees the death of another.', 'The Goad', '', 'publish', 'open', 'closed', '', 'the-goad', '', '', '2015-05-17 21:30:39', '2015-05-17 21:30:39', '', 0, 'http://192.168.1.134/meridian/?post_type=npcs&#038;p=422', 0, 'npcs', '', 0),
