(430, 1, '2015-05-16 19:11:01', '2015-05-16 19:11:01', '', 'Brax', '', 'publish', 'open', 'closed', '', 'brax', '', '', '2015-05-16 19:11:01', '2015-05-16 19:11:01', '', 0, 'http://192.168.1.134/meridian/?post_type=locations&#038;p=430', 0, 'locations', '', 0),
(431, 1, '2015-05-16 19:12:37', '2015-05-16 19:12:37', 'The Cibilo Creek Inn is a common gathering place for students and scholars from the nearby university, and often the site of debate on every manner of issue. D’Franco is encouraging and tolerant of any good discussion, though his views tend to be somewhat conservative.', 'D''Franco', '', 'publish', 'open', 'closed', '', 'dfranco', '', '', '2015-05-17 21:06:07', '2015-05-17 21:06:07', '', 0, 'http://192.168.1.134/meridian/?post_type=npcs&#038;p=431', 0, 'npcs', '', 0),
(432, 1, '2015-05-16 19:13:01', '2015-05-16 19:13:01', 'Hester is from a very distant land, and her adept sewing reflects a distinct tradition that incorporates functionality with a powerful art. The clothes she produces are beautiful.', 'Hester Gilk', '', 'publish', 'open', 'closed', '', 'hester-gilk', '', '', '2015-05-17 21:13:29', '2015-05-17 21:13:29', '', 0, 'http://192.168.1.134/meridian/?post_type=npcs&#038;p=432', 0, 'npcs', '', 0),
(433, 1, '2015-05-16 19:13:27', '2015-05-16 19:13:27', 'A nobleman and former military officer, Rook carries himself with a stiff dignity. He is a weaponsmaster, and makes a living passing his skills on to students of the warriors’ path. His feats with the sword are famous and unparalleled.', 'Rook', '', 'publish', 'open', 'closed', '', 'rook', '', '', '2015-05-17 21:27:54', '2015-05-17 21:27:54', '', 0, 'http://192.168.1.134/meridian/?post_type=npcs&#038;p=433', 0, 'npcs', '', 0),
(434, 1, '2015-05-16 19:13:49', '2015-05-16 19:13:49', 'This shop reflects the fine and exotic tastes<span class="Apple-converted-space"> </span>\r\nof its proprietor. Solomon has collected goods and art from unimaginable corners of the known world, and is rumored to have relics and artifacts from even beyond that.<span class="Apple-converted-space">\r\n</span>', 'Solomon', '', 'publish', 'open', 'closed', '', 'solomon', '', '', '2015-05-17 21:29:40', '2015-05-17 21:29:40', '', 0, 'http://192.168.1.134/meridian/?post_type=npcs&#038;p=434', 0, 'npcs', '', 0),
(435, 1, '2015-05-16 22:29:00', '2015-05-16 22:29:00', 'Renown as the most powerful wizard in the Kingdom, Alzahakar stands proudly before you. You can feel the conflicting will of four separate gods within him. As one of the oldest friends of King Zarcos V, he has been counseling the princess since birth', 'Alzahakar', '', 'publish', 'open', 'closed', '', 'alzahakar', '', '', '2015-05-17 21:02:42', '2015-05-17 21:02:42', '', 0, 'http://192.168.1.134/meridian/?post_type=npcs&#038;p=435', 0, 'npcs', '', 0),
(436, 1, '2015-05-16 22:32:10', '2015-05-16 22:32:10', 'A small vulture like man stuffed in extravagant robes of gold and jewels, he lives in constant fear of others wanting his treasures. Through his studies, he located numerous jewel mines and remains the richest in the land, although his purse is seldom opened.', 'Bei Naq', '', 'publish', 'open', 'closed', '', 'bei-naq', '', '', '2015-05-17 21:03:23', '2015-05-17 21:03:23', '', 0, 'http://192.168.1.134/meridian/?post_type=npcs&#038;p=436', 0, 'npcs', '', 0),
(437, 1, '2015-05-16 22:32:43', '2015-05-16 22:32:43', 'A combat veteran of the wars with Ukgoth, he has mastered every skill of combat. Dressed in light armor and military formal regalia, he lounges at his hut as a general during disgusting peacetime. Cylill has had a long past serving with the Duke’s forces in protecting the world from Trolls and has many war stories to tell..', 'Cylill', '', 'publish', 'open', 'closed', '', 'cylill', '', '', '2015-05-17 21:05:47', '2015-05-17 21:05:47', '', 0, 'http://192.168.1.134/meridian/?post_type=npcs&#038;p=437', 0, 'npcs', '', 0),
(438, 1, '2015-05-16 22:33:43', '2015-05-16 22:33:43', 'A wise physician, he is rumored to have perfected his body’s healing capacity. His body is old and weathered yet perfectly fit. He truly believes the voice of the people should dictate who leads them and allows his alliance to sway between the Duke and Princess.', 'Drechx', '', 'publish', 'open', 'closed', '', 'drechx', '', '', '2015-05-17 21:06:31', '2015-05-17 21:06:31', '', 0, 'http://192.168.1.134/meridian/?post_type=npcs&#038;p=438', 0, 'npcs', '', 0),
(439, 1, '2015-05-16 22:34:31', '2015-05-16 22:34:31', 'A great traveler and explorer, he now hunts for the appearances of the mystical mana nodes. Esseldi attempts to wear the stately dress of the court, yet always manages to tatter them up on his impromptu explorations. He enjoys talking about all of his findings, whether relevant to anyone else or not.', 'Esseldi', '', 'publish', 'open', 'closed', '', 'esseldi', '', '', '2015-05-17 21:08:37', '2015-05-17 21:08:37', '', 0, 'http://192.168.1.134/meridian/?post_type=npcs&#038;p=439', 0, 'npcs', '', 0);
INSERT INTO `wp_posts` (`ID`, `post_author`, `post_date`, `post_date_gmt`, `post_content`, `post_title`, `post_excerpt`, `post_status`, `comment_status`, `ping_status`, `post_password`, `post_name`, `to_ping`, `pinged`, `post_modified`, `post_modified_gmt`, `post_content_filtered`, `post_parent`, `guid`, `menu_order`, `post_type`, `post_mime_type`, `comment_count`) VALUES
(440, 1, '2015-05-16 22:36:10', '2015-05-16 22:36:10', 'Afiera D’xor spent many, many years of solitude in these mountains, and now devotes his life to his art. His stone carvings are intricate designs of mathematical perfection. He will make time, however, to entertain travelers who hope to share some of the wisdom he has gained from a life of secluded meditation.', 'Afiera D''Xor', '', 'publish', 'open', 'closed', '', 'afiera-dxor', '', '', '2015-05-17 21:02:03', '2015-05-17 21:02:03', '', 0, 'http://192.168.1.134/meridian/?post_type=npcs&#038;p=440', 0, 'npcs', '', 0),
(441, 1, '2015-05-16 22:40:17', '2015-05-16 22:40:17', 'As front-line grunt and later a wise general, Jonas D''Accor has fought every manner of evil that has besieged the Meridian cities. Despite that, he has lost the position of Weapon''s Master to Rook and the esteemed seat on the Meridian Council to Cylill. He fancies himself far superior to both, particularly when it comes to strategy and tactics, considering both men to be simple brawlers. In truth, his swordplay is merely adequate, though his tactics are superb.<span class="Apple-converted-space">\r\n</span>', 'Jonas D''Accor', '', 'publish', 'open', 'closed', '', 'jonas-daccor', '', '', '2015-05-17 21:15:39', '2015-05-17 21:15:39', '', 0, 'http://192.168.1.134/meridian/?post_type=npcs&#038;p=441', 0, 'npcs', '', 0),
(442, 1, '2015-05-16 22:40:35', '2015-05-16 22:40:35', 'A peevish and sullen man tends this bar. This is Pietro, the impetuous sot.', 'Pietro', '', 'publish', 'open', 'closed', '', 'pietro', '', '', '2015-05-17 21:22:29', '2015-05-17 21:22:29', '', 0, 'http://192.168.1.134/meridian/?post_type=npcs&#038;p=442', 0, 'npcs', '', 0),
(443, 1, '2015-05-16 22:41:24', '2015-05-16 22:41:24', 'Quintor is widely recognized as the finest weaponsmith in the land. He is also recognized as a quiet, brooding man who keeps to himself. Take that as you will.', 'Quintor', '', 'publish', 'open', 'closed', '', 'quintor', '', '', '2015-05-17 21:26:17', '2015-05-17 21:26:17', '', 0, 'http://192.168.1.134/meridian/?post_type=npcs&#038;p=443', 0, 'npcs', '', 0),
(444, 1, '2015-05-16 22:42:10', '2015-05-16 22:42:10', 'The Widow Qesino has run the Yonder Inn since her late husbands’ disappearance. She seems to be a very straightforward woman.', 'Widow Qesino', '', 'publish', 'open', 'closed', '', 'widow-qesino', '', '', '2015-05-17 21:32:06', '2015-05-17 21:32:06', '', 0, 'http://192.168.1.134/meridian/?post_type=npcs&#038;p=444', 0, 'npcs', '', 0),
(445, 1, '2015-05-16 22:42:35', '2015-05-16 22:42:35', 'Yevitan studies you with thoughtful, intelligent eyes. He is surprisingly spry for his age.', 'Yevitan', '', 'publish', 'open', 'closed', '', 'yevitan', '', '', '2015-05-17 21:33:24', '2015-05-17 21:33:24', '', 0, 'http://192.168.1.134/meridian/?post_type=npcs&#038;p=445', 0, 'npcs', '', 0),
(446, 1, '2015-05-16 22:43:04', '2015-05-16 22:43:04', 'Zhieu B’hob works very hard to make his business thrive in this depressed community. He is eager, and busy with the appearances.', 'Zhieu B''hob', '', 'publish', 'open', 'closed', '', 'zhieu-bhob', '', '', '2015-05-17 21:34:01', '2015-05-17 21:34:01', '', 0, 'http://192.168.1.134/meridian/?post_type=npcs&#038;p=446', 0, 'npcs', '', 0),
(447, 1, '2015-05-16 22:45:45', '2015-05-16 22:45:45', 'As the one of the highest ranking officers in the Ko''catan Army, Cital ko''Manca is serious and crisp in his duties. In peacetime these duties include supervising the main gatehouse during daylight against actions by enemies unknown. Cital ko''Manca is extraordinarily young to have achieved such a high rank, but he is well respected for his fairness and his adherence to military law.', 'Cital ko''Manca', '', 'publish', 'open', 'closed', '', 'cital-komanca', '', '', '2015-05-17 21:04:53', '2015-05-17 21:04:53', '', 0, 'http://192.168.1.134/meridian/?post_type=npcs&#038;p=447', 0, 'npcs', '', 0),
(448, 1, '2015-05-16 22:45:23', '2015-05-16 22:45:23', '', 'KO''CATAN', '', 'publish', 'open', 'closed', '', 'kocatan', '', '', '2015-05-16 22:45:23', '2015-05-16 22:45:23', '', 0, 'http://192.168.1.134/meridian/?post_type=locations&#038;p=448', 0, 'locations', '', 0),
(449, 1, '2015-05-16 22:46:41', '2015-05-16 22:46:41', 'Well respected as the master of all monetary affairs on the island, Huital pays close attention to the economy and how it relates to every business. Before engaging in any new transaction of coins, he quickly washes his hands in the pedestal of clear water.', 'Huital ko''Nosak', '', 'publish', 'open', 'closed', '', 'huital-konosak', '', '', '2015-05-17 21:13:51', '2015-05-17 21:13:51', '', 0, 'http://192.168.1.134/meridian/?post_type=npcs&#038;p=449', 0, 'npcs', '', 0),
(450, 1, '2015-05-16 22:47:22', '2015-05-16 22:47:22', 'Itzal’s often rude attitude and awkward bodily noises make him far less popular than his fraternal twin, Huital. With a labored sigh and a piggish grunt, he begrudgingly accommodates the needs of those who wish to store items in the vault.', 'Itzal cha''Nosak', '', 'publish', 'open', 'closed', '', 'itzal-chanosak', '', '', '2015-05-17 21:14:09', '2015-05-17 21:14:09', '', 0, 'http://192.168.1.134/meridian/?post_type=npcs&#038;p=450', 0, 'npcs', '', 0),
(451, 1, '2015-05-16 22:48:27', '2015-05-16 22:48:27', 'This powerful woman has established herself as the preeminent weaponsmith in the warrior society of Ko’catan. She has also established herself as a woman with a gift for speaking the most colorful parts of the Ko’catan language.', 'Ixla cha''Totlak', '', 'publish', 'open', 'closed', '', 'ixla-chatotlak', '', '', '2015-05-17 21:14:25', '2015-05-17 21:14:25', '', 0, 'http://192.168.1.134/meridian/?post_type=npcs&#038;p=451', 0, 'npcs', '', 0),
(452, 1, '2015-05-16 22:49:01', '2015-05-16 22:49:01', 'An older man who is obviously blind in both eyes. With his every move exacting and his every word said with forethought, this former warrior defines the slow grace of a seasoned hunter. Noted for his keen ear, some say he can hear those things that make no noise, like a frown or a doubting thought.', 'Kochtal ko''Tulca', '', 'publish', 'open', 'closed', '', 'kochtal-kotulca', '', '', '2015-05-17 21:15:54', '2015-05-17 21:15:54', '', 0, 'http://192.168.1.134/meridian/?post_type=npcs&#038;p=452', 0, 'npcs', '', 0),
(453, 1, '2015-05-16 22:49:33', '2015-05-16 22:49:33', 'Entrepreneurial by nature, Moxal ix’Hanak is always on the look out for a new high risk investment. He greets you with a confident smile and a clandestine gleam in his eye.', 'Moxal ix''Hanak', '', 'publish', 'open', 'closed', '', 'moxal-ixhanak', '', '', '2015-05-17 21:19:32', '2015-05-17 21:19:32', '', 0, 'http://192.168.1.134/meridian/?post_type=npcs&#038;p=453', 0, 'npcs', '', 0),
(454, 1, '2015-05-16 22:50:23', '2015-05-16 22:50:23', 'After losing his right arm in action at Balo na’te Din, Oxal was discharged from service with the Ko’catan Army and assigned to The Barking Monster. It is a great honor to be the veteran selected to run this military owned establishment, but Oxal performs the work with little apparent relish.', 'Oxal ix''Tokak', '', 'publish', 'open', 'closed', '', 'oxal-ixtokak', '', '', '2015-05-17 21:20:12', '2015-05-17 21:20:12', '', 0, 'http://192.168.1.134/meridian/?post_type=npcs&#038;p=454', 0, 'npcs', '', 0),
(455, 1, '2015-05-16 22:51:01', '2015-05-16 22:51:01', 'This somewhat scattered man runs a very scattered store set in an abandoned arsenal. Regardless of his apparent lack of organization, Pacal has a remarkable understanding of exactly what is here and where.', 'Pacal ix''Anoak', '', 'publish', 'open', 'closed', '', 'pacal-ixanoak', '', '', '2015-05-17 21:21:49', '2015-05-17 21:21:49', '', 0, 'http://192.168.1.134/meridian/?post_type=npcs&#038;p=455', 0, 'npcs', '', 0),
(456, 1, '2015-05-16 22:51:30', '2015-05-16 22:51:30', 'Brilliant yet begrudged by most of the island for his age, this high pitched youth rose from an annoying bookworm to one of the most sought after individuals due to his extensive knowledge of languages. He regards most of the adults around him as intellectual inferiors who cannot appreciate his mind.', 'Quetzal', '', 'publish', 'open', 'closed', '', 'quetzal', '', '', '2015-05-17 21:26:01', '2015-05-17 21:26:01', '', 0, 'http://192.168.1.134/meridian/?post_type=npcs&#038;p=456', 0, 'npcs', '', 0),
(457, 1, '2015-05-16 22:51:59', '2015-05-16 22:51:59', 'Tepal’s quick, furtive eyes give away the abundant and nervous energy which occupies him. Something about him tells you that he has good reason to be nervous.', 'Tepal ix''Zonak', '', 'publish', 'open', 'closed', '', 'tepal-ixzonak', '', '', '2015-05-17 21:30:24', '2015-05-17 21:30:24', '', 0, 'http://192.168.1.134/meridian/?post_type=npcs&#038;p=457', 0, 'npcs', '', 0),
(458, 1, '2015-05-16 22:52:26', '2015-05-16 22:52:26', 'As the one of the highest ranking officers in the Ko’catan Army, Xacal ko’Ixca is a veteran of many campaigns. His peacetime duties include supervising the main gatehouse during the night hours against actions by enemies unknown, and since this is a time of relative peace part of Xacal ko’Ixca’s duties consist of defining just who those enemies are. He is widely respected for his toughness and ability to get results.', 'Xacal ko''Ixca', '', 'publish', 'open', 'closed', '', 'xacal-koixca', '', '', '2015-05-17 21:33:04', '2015-05-17 21:33:04', '', 0, 'http://192.168.1.134/meridian/?post_type=npcs&#038;p=458', 0, 'npcs', '', 0),
(459, 1, '2015-05-16 22:53:30', '2015-05-16 22:53:30', 'Zala is a slow moving woman who obviously enjoys the earthly pleasures. She talks in a soft, husky voice between long drags on her clay pipe.', 'Zala ix''Mecya', '', 'publish', 'open', 'closed', '', 'zala-ixmecya', '', '', '2015-05-17 21:33:40', '2015-05-17 21:33:40', '', 0, 'http://192.168.1.134/meridian/?post_type=npcs&#038;p=459', 0, 'npcs', '', 0),
(460, 1, '2015-05-16 22:54:56', '2015-05-16 22:54:56', 'Leering at you as if you were a potential subject for some twisted experiment, Bahal smiles and chortles to himself. The moody little man seems unnaturally obsessed with the horrific and the bizarre.', 'Bahal zax''Ot', '', 'publish', 'open', 'closed', '', 'bahal-zaxot', '', '', '2015-05-17 21:03:09', '2015-05-17 21:03:09', '', 0, 'http://192.168.1.134/meridian/?post_type=npcs&#038;p=460', 0, 'npcs', '', 0),
(461, 1, '2015-05-16 22:54:48', '2015-05-16 22:54:48', '', 'Ko''Catan Jungle', '', 'publish', 'open', 'closed', '', 'kocatan-jungle', '', '', '2015-05-16 22:54:48', '2015-05-16 22:54:48', '', 0, 'http://192.168.1.134/meridian/?post_type=locations&#038;p=461', 0, 'locations', '', 0),
(462, 1, '2015-05-16 22:55:54', '2015-05-16 22:55:54', 'This female Avar has been exiled from her society for her illegal magic practices. At least that''s the common belief, although it is difficult to determine if any reason can be applied to this strange creature.', 'Bone Priestess', '', 'publish', 'open', 'closed', '', 'bone-priestess', '', '', '2015-05-17 21:03:39', '2015-05-17 21:03:39', '', 0, 'http://192.168.1.134/meridian/?post_type=npcs&#038;p=462', 0, 'npcs', '', 0),
(463, 1, '2015-05-16 22:56:17', '2015-05-16 22:56:17', 'This becoming, young woman appears as cold and curt to new faces. Despite that, it is obvious to all that her true passion lies in the crafting of fine bows.<span class="Apple-converted-space">\r\n</span>', 'Hanla zax''Ta', '', 'publish', 'open', 'closed', '', 'hanla-zaxta', '', '', '2015-05-17 21:10:15', '2015-05-17 21:10:15', '', 0, 'http://192.168.1.134/meridian/?post_type=npcs&#038;p=463', 0, 'npcs', '', 0),
(464, 1, '2015-05-16 22:57:34', '2015-05-16 22:57:34', 'A remarkable man fallen upon a tough life, Wulfgang was born on the mainland and raised in the persecuted secret society of the last Riija School. Besides that he somehow escaped to this island and established his trading post, little else is known about Wulfgang’s past.', 'Wulfgang zax''Ak', '', 'publish', 'open', 'closed', '', 'wulfgang-zaxak', '', '', '2015-05-17 21:32:22', '2015-05-17 21:32:22', '', 0, 'http://192.168.1.134/meridian/?post_type=npcs&#038;p=464', 0, 'npcs', '', 0),
(465, 1, '2015-05-16 22:58:30', '2015-05-16 22:58:30', 'A country blacksmith with years of pounding the anvil ringing in his ears, Colhorr is an established landmark in Marion. Most of his work consists of fabricating and repairing farming implements and hardware for the agrarian locals.', 'Colhorr', '', 'publish', 'open', 'closed', '', 'colhorr', '', '', '2015-05-17 21:05:15', '2015-05-17 21:05:15', '', 0, 'http://192.168.1.134/meridian/?post_type=npcs&#038;p=465', 0, 'npcs', '', 0),
(466, 1, '2015-05-16 22:59:07', '2015-05-16 22:59:07', 'In the presence of Lady Aftyn there is no mistaking that she is of royalty, and not from these parts. She exudes a sense of peaceful determination; of confidence, serenity, and purpose.', 'Lady Aftyn', '', 'publish', 'open', 'closed', '', 'lady-aftyn', '', '', '2015-05-17 21:16:19', '2015-05-17 21:16:19', '', 0, 'http://192.168.1.134/meridian/?post_type=npcs&#038;p=466', 0, 'npcs', '', 0),
(467, 1, '2015-05-16 23:00:36', '2015-05-16 23:00:36', 'A silly little man, Morrigan maintains a modest business alternately buying and selling reagents and other various notions. Although his heart doesn’t seem to be in commerce, there can be little doubt Morrigan loves his job.', 'Morrigan', '', 'publish', 'open', 'closed', '', 'morrigan', '', '', '2015-05-17 21:19:17', '2015-05-17 21:19:17', '', 0, 'http://192.168.1.134/meridian/?post_type=npcs&#038;p=467', 0, 'npcs', '', 0),
(468, 1, '2015-05-16 23:01:05', '2015-05-16 23:01:05', 'Although the villagers of Marion sometimes make jokes about his growing senility, this wise man knows much lore about the land.', 'Ran''er Hoth', '', 'publish', 'open', 'closed', '', 'raner-hoth', '', '', '2015-05-17 21:26:33', '2015-05-17 21:26:33', '', 0, 'http://192.168.1.134/meridian/?post_type=npcs&#038;p=468', 0, 'npcs', '', 0),
(469, 1, '2015-05-16 23:01:49', '2015-05-16 23:01:49', 'There is no overlooking Tova, a bellowing and uproarious man who takes life exactly as it comes through the front door of the Limping Toad. He is the proprietor here, serving drinks and entertaining from his self-styled rostrum noted for it’s powerful stout.', 'Tova', '', 'publish', 'open', 'closed', '', 'tova', '', '', '2015-05-17 21:31:36', '2015-05-17 21:31:36', '', 0, 'http://192.168.1.134/meridian/?post_type=npcs&#038;p=469', 0, 'npcs', '', 0),
(470, 1, '2015-05-16 23:04:25', '2015-05-16 23:04:25', 'A grinning and mischievous man stands quietly grinning behind the bar.', 'Eric d''Jorn', '', 'publish', 'open', 'closed', '', 'eric-djorn', '', '', '2015-05-17 21:08:18', '2015-05-17 21:08:18', '', 0, 'http://192.168.1.134/meridian/?post_type=npcs&#038;p=470', 0, 'npcs', '', 0),
(471, 1, '2015-05-16 23:04:16', '2015-05-16 23:04:16', '', 'Raza', '', 'publish', 'open', 'closed', '', 'raza', '', '', '2015-05-16 23:04:16', '2015-05-16 23:04:16', '', 0, 'http://192.168.1.134/meridian/?post_type=locations&#038;p=471', 0, 'locations', '', 0),
(472, 1, '2015-05-16 23:05:15', '2015-05-16 23:05:15', 'A veteran of the Orc Wars, Marcus now seems content to settle into his new life running a small and quiet country inn.', 'Marcus', '', 'publish', 'open', 'closed', '', 'marcus', '', '', '2015-05-17 21:17:53', '2015-05-17 21:17:53', '', 0, 'http://192.168.1.134/meridian/?post_type=npcs&#038;p=472', 0, 'npcs', '', 0),
(473, 1, '2015-05-16 23:05:36', '2015-05-16 23:05:36', 'A strange man of unknown origin, Ravi is always willing to buy reagents and gems for his inventory-poor shop', 'Ravi', '', 'publish', 'open', 'closed', '', 'ravi', '', '', '2015-05-17 21:26:48', '2015-05-17 21:26:48', '', 0, 'http://192.168.1.134/meridian/?post_type=npcs&#038;p=473', 0, 'npcs', '', 0),
(474, 1, '2015-05-16 23:06:13', '2015-05-16 23:06:13', 'The old man looks back at you with eyes that have seen beyond forever.', 'Rodric d''Stane', '', 'publish', 'open', 'closed', '', 'rodric-dstane', '', '', '2015-05-17 21:27:41', '2015-05-17 21:27:41', '', 0, 'http://192.168.1.134/meridian/?post_type=npcs&#038;p=474', 0, 'npcs', '', 0),
(475, 1, '2015-05-16 23:06:48', '2015-05-16 23:06:48', 'A maker of unremarkable but reliable weapons, Tomas earns his customers with good comradeship and low prices.', 'Tomas', '', 'publish', 'open', 'closed', '', 'tomas', '', '', '2015-05-17 21:31:23', '2015-05-17 21:31:23', '', 0, 'http://192.168.1.134/meridian/?post_type=npcs&#038;p=475', 0, 'npcs', '', 0),
(476, 1, '2015-05-16 23:07:14', '2015-05-16 23:07:14', 'Floating several feet above the ground, this enigma of a being watches you. When it speaks, the monk''s voice crackles like century old parchment. You have a very uneasy feeling that all is not as it seems.', 'Monk of Riija', '', 'publish', 'open', 'closed', '', 'monk-of-riija', '', '', '2015-05-17 21:19:03', '2015-05-17 21:19:03', '', 0, 'http://192.168.1.134/meridian/?post_type=npcs&#038;p=476', 0, 'npcs', '', 0),
(477, 1, '2015-05-16 23:08:12', '2015-05-16 23:08:12', 'Hair unkempt and anger barely checked, Tenuv''vyal watches you like a storm in the distant sky.', 'Priestess Tenuv''vyal', '', 'publish', 'open', 'closed', '', 'priestess-tenuvvyal', '', '', '2015-05-17 21:23:28', '2015-05-17 21:23:28', '', 0, 'http://192.168.1.134/meridian/?post_type=npcs&#038;p=477', 0, 'npcs', '', 0),
(478, 1, '2015-05-16 23:08:45', '2015-05-16 23:08:45', 'The priestess exudes a glow of peaceful serenity.', 'Priestess Xiana', '', 'publish', 'open', 'closed', '', 'priestess-xiana', '', '', '2015-05-17 21:23:40', '2015-05-17 21:23:40', '', 0, 'http://192.168.1.134/meridian/?post_type=npcs&#038;p=478', 0, 'npcs', '', 0),
(479, 1, '2015-05-16 23:09:45', '2015-05-16 23:09:45', 'Qerti’nya is very judgmental of the strength of those who come before her. Blood and hellfire are the tools of this priestess, for only the strong and good meaning deserve to live. She is quick to make accusations or statements. Although she delivers a powerful sermon, she is likely to go out drinking with the men after it is over.', 'Priestess Qerti''nya', '', 'publish', 'open', 'closed', '', 'priestess-qertinya', '', '', '2015-05-17 21:22:47', '2015-05-17 21:22:47', '', 0, 'http://192.168.1.134/meridian/?post_type=npcs&#038;p=479', 0, 'npcs', '', 0),
(480, 1, '2015-05-16 23:10:11', '2015-05-16 23:10:11', 'You find yourself gazing at a perfect servant of Qor the Vile. Shadows seem to deepen where this malevolent woman stands.', 'Priestess Zuxana', '', 'publish', 'open', 'closed', '', 'priestess-zuxana', '', '', '2015-05-17 21:23:57', '2015-05-17 21:23:57', '', 0, 'http://192.168.1.134/meridian/?post_type=npcs&#038;p=480', 0, 'npcs', '', 0),
(481, 1, '2015-05-16 23:11:45', '2015-05-16 23:11:45', 'With a sickly sweet child''s voice and an unwholesome look of innocense, the Priestess of Riija welcomes you to her inner sanctum of unreality.', 'Spooky Little Girl', '', 'publish', 'open', 'closed', '', 'spooky-little-girl', '', '', '2015-05-17 21:29:54', '2015-05-17 21:29:54', '', 0, 'http://192.168.1.134/meridian/?post_type=npcs&#038;p=481', 0, 'npcs', '', 0),
(482, 1, '2015-05-16 23:12:08', '2015-05-16 23:12:08', 'A strange feeling comes over you as you perceive that there is a force deep inside this statue. A soft, singing voice, fills your senses. Her eyes seem to follow you, taking careful notice of your actions. A feeling of well being and protection washes over you, and you know that you can trust in her guidance.', 'LadyPhoenix', '', 'publish', 'open', 'closed', '', 'ladyphoenix', '', '', '2015-05-17 21:16:38', '2015-05-17 21:16:38', '', 0, 'http://192.168.1.134/meridian/?post_type=npcs&#038;p=482', 0, 'npcs', '', 0),
(483, 1, '2015-05-16 23:15:13', '2015-05-16 23:15:13', 'Despite being only 16 years old Duke Akardius skillfully maneuvered himself into position to succeed his murdered uncle. The young Duke simply radiates confidence and power. Rumor has it that he is a zealous devotee of Riija and his cunning smile suggests the manipulative, deceitful aspect of the Trickster God. In spite of his lavish and very public displays of mourning for his Uncle, there are some who doubt the sincerity of his grief.', 'Duke Akardius', '', 'publish', 'open', 'closed', '', 'duke-akardius', '', '', '2015-05-17 21:06:51', '2015-05-17 21:06:51', '', 0, 'http://192.168.1.134/meridian/?post_type=npcs&#038;p=483', 0, 'npcs', '', 0),
(484, 1, '2015-05-16 23:16:03', '2015-05-16 23:16:03', 'Commanding and straightforward, he influences many. Currently deceased. He was brutally assasinated.', 'Duke Kalior', '', 'publish', 'open', 'closed', '', 'duke-kalior', '', '', '2015-05-17 21:07:23', '2015-05-17 21:07:23', '', 0, 'http://192.168.1.134/meridian/?post_type=npcs&#038;p=484', 0, 'npcs', '', 0),
(485, 1, '2015-05-16 23:17:10', '2015-05-16 23:17:10', 'This sickly man stares at you with bleary eyes from behind the counter. His breathing is somewhat labored and sweat mattes his forehead. Frisconar is almost as well known for his keen interest in magical reagents as he is for his dour out look on life.', 'Frisconar', '', 'publish', 'open', 'closed', '', 'frisconar', '', '', '2015-05-17 21:09:26', '2015-05-17 21:09:26', '', 0, 'http://192.168.1.134/meridian/?post_type=npcs&#038;p=485', 0, 'npcs', '', 0),
(486, 1, '2015-05-16 23:17:02', '2015-05-16 23:17:02', '', 'Tos', '', 'publish', 'open', 'closed', '', 'tos', '', '', '2015-05-16 23:17:02', '2015-05-16 23:17:02', '', 0, 'http://192.168.1.134/meridian/?post_type=locations&#038;p=486', 0, 'locations', '', 0),
(487, 1, '2015-05-16 23:18:00', '2015-05-16 23:18:00', 'As owner of perhaps the most popular bar in the world, Paddock goes out of his way to smile at every customer who comes through the door. His down to earth demeanor and common man approach to his clientele makes him one of the most likable men in Tos.', 'Paddock', '', 'publish', 'open', 'closed', '', 'paddock', '', '', '2015-05-17 21:22:03', '2015-05-17 21:22:03', '', 0, 'http://192.168.1.134/meridian/?post_type=npcs&#038;p=487', 0, 'npcs', '', 0),
(488, 1, '2015-05-16 23:18:36', '2015-05-16 23:18:36', 'The younger, prissy, and less competent brother of Paddock casually lounges behind the bar. While sipping from goblet (pinky outstretched), he slowly bobs his head to the music.', 'Rycksher', '', 'publish', 'open', 'closed', '', 'rycksher', '', '', '2015-05-17 21:28:32', '2015-05-17 21:28:32', '', 0, 'http://192.168.1.134/meridian/?post_type=npcs&#038;p=488', 0, 'npcs', '', 0),
(489, 1, '2015-05-16 23:19:04', '2015-05-16 23:19:04', 'Skivlat spends all of his time in the company of money and it shows. His hand lovingly caresses the gold as a large doting smile forms on his face. Every so often he will jingle the bag just to hear the melodious clinking of shillings.', 'Skivlat', '', 'publish', 'open', 'closed', '', 'skivlat', '', '', '2015-05-17 21:28:48', '2015-05-17 21:28:48', '', 0, 'http://192.168.1.134/meridian/?post_type=npcs&#038;p=489', 0, 'npcs', '', 0),
(490, 1, '2015-05-16 23:21:35', '2015-05-16 23:21:35', '', 'Watcher', '', 'publish', 'open', 'closed', '', 'watcher', '', '', '2015-05-17 21:31:50', '2015-05-17 21:31:50', '', 0, 'http://192.168.1.134/meridian/?post_type=npcs&#038;p=490', 0, 'npcs', '', 0),
(491, 1, '2015-05-16 23:21:27', '2015-05-16 23:21:27', 'The son of Priestess Qerti’nya and General Cylill, young Cort has been appointed the Watcher of the Glorious Arena of Kraanan. A calm smile graces his face as he oversees the mock combats held in the name of Kraanan the Fist.', 'The Arena of Kraanan', '', 'publish', 'open', 'closed', '', 'the-arena-of-kraanan', '', '', '2015-05-16 23:21:27', '2015-05-16 23:21:27', '', 0, 'http://192.168.1.134/meridian/?post_type=locations&#038;p=491', 0, 'locations', '', 0),
(492, 1, '2015-05-16 23:22:25', '2015-05-16 23:22:25', 'Izzio carries his massive sack and bulging belly with surprising ease and grace. A beatific grin and blissful eyes speak to Izzio''s simple joy with nature. Unfortunately Izzio''s Zen-like communion with the natural does not temper his obsessive pursuit of profit.', 'Izzio', '', 'publish', 'open', 'closed', '', 'izzio', '', '', '2015-05-17 21:14:42', '2015-05-17 21:14:42', '', 0, 'http://192.168.1.134/meridian/?post_type=npcs&#038;p=492', 0, 'npcs', '', 0),
(493, 1, '2015-05-16 23:22:56', '2015-05-16 23:22:56', 'You can feel that you are in the presence of a powerful warlock. Invasive magic weighs heavily in the air surrounding this wandering sorcerer. His knowledge of the intricacies of spell learning is unsurpassed, though his public dislike for the temples has made him an outcast of the Royal Court.', 'Maleval', '', 'publish', 'open', 'closed', '', 'maleval', '', '', '2015-05-17 21:17:37', '2015-05-17 21:17:37', '', 0, 'http://192.168.1.134/meridian/?post_type=npcs&#038;p=493', 0, 'npcs', '', 0),
(494, 1, '2015-05-16 23:23:37', '2015-05-16 23:23:37', 'Outcast by the religious community due to her blasphemous views of the gods, Miriana dances by herself far from the rigid walls of civilization. Some call her a heretic, others a child, but all seem to find something beguiling about the distant girl.', 'Miriana', '', 'publish', 'open', 'closed', '', 'miriana', '', '', '2015-05-17 21:18:24', '2015-05-17 21:18:24', '', 0, 'http://192.168.1.134/meridian/?post_type=npcs&#038;p=494', 0, 'npcs', '', 0),
(495, 1, '2015-05-16 23:23:59', '2015-05-16 23:23:59', 'Parrin is widely known across the land, but rarely spoken of favorably. Although extremely gifted with the lyre, this traveling minstrel''s lyrics and puns habitually bring groans of disgust from those who are forced to listen. Rumor has it that Paddock has threatened to kill Parrin should he ever set foot in Familiars again. For a generous tip, he may sing of your exploits. For a bigger tip, he may even leave.<span class="Apple-converted-space">\r\n</span>', 'Parrin Aragone', '', 'publish', 'open', 'closed', '', 'parrin-aragone', '', '', '2015-05-17 21:22:16', '2015-05-17 21:22:16', '', 0, 'http://192.168.1.134/meridian/?post_type=npcs&#038;p=495', 0, 'npcs', '', 0),
(496, 1, '2015-05-16 23:24:23', '2015-05-16 23:24:23', 'This earthy mage''s demeanor is so calm and peaceful that you can''t help but wonder why his ghostly shade still walks this plane.', 'Tendrath', '', 'publish', 'open', 'closed', '', 'tendrath', '', '', '2015-05-17 21:30:09', '2015-05-17 21:30:09', '', 0, 'http://192.168.1.134/meridian/?post_type=npcs&#038;p=496', 0, 'npcs', '', 0),
