(599, 1, '2015-05-17 21:20:24', '2015-05-17 21:20:24', '<p>After losing his right arm in action at Balo na’te Din, Oxal was discharged from service with the Ko’catan Army and assigned to The Barking Monster. It is a great honor to be the veteran selected to run this military owned establishment, but Oxal performs the work with little apparent relish.</p>\n', 'Oxal ix''Tokak', '', 'inherit', 'open', 'closed', '', '454-autosave-v1', '', '', '2015-05-17 21:20:24', '2015-05-17 21:20:24', '', 454, 'http://192.168.1.134/meridian/454-autosave-v1/', 0, 'revision', '', 0),
(600, 1, '2015-05-17 21:23:14', '2015-05-17 21:23:14', '<p>Hair unkempt and anger barely checked, Tenuv''vyal watches you like a storm in the distant sky.</p>\n', 'Priestess Tenuv''vyal', '', 'inherit', 'open', 'closed', '', '477-autosave-v1', '', '', '2015-05-17 21:23:14', '2015-05-17 21:23:14', '', 477, 'http://192.168.1.134/meridian/477-autosave-v1/', 0, 'revision', '', 0),
(601, 1, '2015-05-17 21:25:10', '2015-05-17 21:25:10', '<p>A noble women of stunning beauty, Queen Venya''cyr carries herself with a refined demeanor hardly still seen in this day and age. You can''t help but marvel at how she has managed to keep her beautiful face so young and vibrant through all of these centuries.</p>\n', 'Queen Venya''cyr', '', 'inherit', 'open', 'closed', '', '421-autosave-v1', '', '', '2015-05-17 21:25:10', '2015-05-17 21:25:10', '', 421, 'http://192.168.1.134/meridian/421-autosave-v1/', 0, 'revision', '', 0),
(602, 1, '2015-05-17 21:27:00', '2015-05-17 21:27:00', '<p>A strange man of unknown origin, Ravi is always willing to buy reagents and gems for his inventory-poor shop</p>\n', 'Ravi', '', 'inherit', 'open', 'closed', '', '473-autosave-v1', '', '', '2015-05-17 21:27:00', '2015-05-17 21:27:00', '', 473, 'http://192.168.1.134/meridian/473-autosave-v1/', 0, 'revision', '', 0),
(603, 1, '2015-05-17 21:27:14', '2015-05-17 21:27:14', '<p>The old man looks back at you with eyes that have seen beyond forever.</p>\n', 'Rodric d''Stane', '', 'inherit', 'open', 'closed', '', '474-autosave-v1', '', '', '2015-05-17 21:27:14', '2015-05-17 21:27:14', '', 474, 'http://192.168.1.134/meridian/474-autosave-v1/', 0, 'revision', '', 0),
