(610, 1, '2015-05-21 23:43:47', '2015-05-21 23:43:47', 'Creates a thicket of thorny, twisted bramble. Such a wall would be painful to pass, though it wouldn''t much harm one who remained motionless. Requires elderberries and yrxl sap to cast. Casting this spell can cause you to be labeled an outlaw.', 'Bramble Wall', '', 'publish', 'open', 'closed', '', 'bramble-wall', '', '', '2015-07-10 02:20:49', '2015-07-10 02:20:49', '', 0, 'http://192.168.1.134/meridian/?post_type=spells&#038;p=610', 0, 'spells', '', 0),
(611, 1, '2015-05-21 23:44:29', '2015-05-21 23:44:29', 'Coats your fingers with ice which can freeze a patch of flesh on your target, painfully destroying the outer layer of tissue. Requires a red mushroom.', 'Icy Fingers', '', 'publish', 'open', 'closed', '', 'icy-fingers', '', '', '2015-07-10 02:21:14', '2015-07-10 02:21:14', '', 0, 'http://192.168.1.134/meridian/?post_type=spells&#038;p=611', 0, 'spells', '', 0),
