(635, 1, '2015-05-22 01:02:49', '2015-05-22 01:02:49', 'This song makes people happy! It is a lively tune, which makes people feel as if they have a new start on life. The song causes some people to smile, often resulting in better moods. A good mood allows others to fight evil more effectively. It requires 1 sapphire to cast.', 'Mirth', '', 'publish', 'open', 'closed', '', 'mirth', '', '', '2015-07-10 02:30:18', '2015-07-10 02:30:18', '', 0, 'http://192.168.1.134/meridian/?post_type=spells&#038;p=635', 0, 'spells', '', 0),
