(697, 1, '2015-05-23 02:08:16', '2015-05-23 02:08:16', 'Permeates an area with the unholy essence of Qor, harming any who attempt to call on the holy energy of Shal''ille. Requires yrxl sap and fairy wings to cast. Casting this spell can cause you to be labeled an outlaw.', 'Shal''ille Bane', '', 'publish', 'open', 'closed', '', 'shalille-bane', '', '', '2015-06-12 00:25:58', '2015-06-12 00:25:58', '', 0, 'http://192.168.1.134/meridian/?post_type=spells&#038;p=697', 0, 'spells', '', 0),
(698, 1, '2015-05-23 02:09:35', '2015-05-23 02:09:35', 'Splashes Qor''s unholy corrosive acid on a target at short range. Requires entroot berries to cast. Casting this spell can cause you to be labeled an outlaw.', 'Splash of Acid', '', 'publish', 'open', 'closed', '', 'splash-of-acid', '', '', '2015-07-10 02:48:53', '2015-07-10 02:48:53', '', 0, 'http://192.168.1.134/meridian/?post_type=spells&#038;p=698', 0, 'spells', '', 0);
INSERT INTO `wp_posts` (`ID`, `post_author`, `post_date`, `post_date_gmt`, `post_content`, `post_title`, `post_excerpt`, `post_status`, `comment_status`, `ping_status`, `post_password`, `post_name`, `to_ping`, `pinged`, `post_modified`, `post_modified_gmt`, `post_content_filtered`, `post_parent`, `guid`, `menu_order`, `post_type`, `post_mime_type`, `comment_count`) VALUES
(699, 1, '2015-05-23 02:10:37', '2015-05-23 02:10:37', 'The magical force of Qor burns the target''s eyes, taking away all sight for a brief period. Requires entroot berries and purple mushrooms to cast. Casting this spell can cause you to be labeled an outlaw.', 'Blind', '', 'publish', 'open', 'closed', '', 'blind', '', '', '2015-07-10 02:49:26', '2015-07-10 02:49:26', '', 0, 'http://192.168.1.134/meridian/?post_type=spells&#038;p=699', 0, 'spells', '', 0),
(700, 1, '2015-05-23 02:11:26', '2015-05-23 02:11:26', 'Infuses a weapon with the malevolent power of Qor. It is impossible to predict exactly what form this dark benediction will take, but it will always be deadly. Requires shaman blood, entroot berries, and orc teeth.', 'Blood Inheritance', '', 'publish', 'open', 'closed', '', 'blood-inheritance', '', '', '2015-07-10 02:49:40', '2015-07-10 02:49:40', '', 0, 'http://192.168.1.134/meridian/?post_type=spells&#038;p=700', 0, 'spells', '', 0),
(701, 1, '2015-05-23 02:12:27', '2015-05-23 02:12:27', 'This dark spell feeds off the souls of any poor creature that should happen to fall in your vicinity. Requires shaman blood and polished seraphym to cast.', 'Death Link', '', 'publish', 'open', 'closed', '', 'death-link', '', '', '2015-06-12 00:26:16', '2015-06-12 00:26:16', '', 0, 'http://192.168.1.134/meridian/?post_type=spells&#038;p=701', 0, 'spells', '', 0),
(702, 1, '2015-05-23 02:13:24', '2015-05-23 02:13:24', 'Qor cloaks your body with a shimmering field leaving you invisible for a brief period. Requires dark angel feathers to cast.', 'Invisibility', '', 'publish', 'open', 'closed', '', 'invisibility', '', '', '2015-07-10 02:49:57', '2015-07-10 02:49:57', '', 0, 'http://192.168.1.134/meridian/?post_type=spells&#038;p=702', 0, 'spells', '', 0),
(703, 1, '2015-05-23 02:14:16', '2015-05-23 02:14:16', 'You tap all of your mana nodes to the maximum, giving you an instant burst of mana and health, but destroying your bonds. May only be cast once per day. Requires fairy wings and entroot berries and is very tiring to cast.', 'Node Burst', '', 'publish', 'open', 'closed', '', 'node-burst', '', '', '2015-07-10 02:50:07', '2015-07-10 02:50:07', '', 0, 'http://192.168.1.134/meridian/?post_type=spells&#038;p=703', 0, 'spells', '', 0),
(704, 1, '2015-05-23 02:15:29', '2015-05-23 02:15:29', 'The darker gods grant you the power to randomly exchange one item from your inventory with one from the target''s. Requires dark angel feathers, yrxl sap, and purple mushrooms to cast. Casting this spell can cause you to be labeled an outlaw.', 'Swap', '', 'publish', 'open', 'closed', '', 'swap', '', '', '2015-06-12 00:26:22', '2015-06-12 00:26:22', '', 0, 'http://192.168.1.134/meridian/?post_type=spells&#038;p=704', 0, 'spells', '', 0),
(705, 1, '2015-05-23 02:17:07', '2015-05-23 02:17:07', 'Grants the caster the ability to paralyze any who meet his gaze. Requires yrxl sap and purple mushrooms to cast.', 'Gaze of the Basilisk', '', 'publish', 'open', 'closed', '', 'gaze-of-the-basilisk', '', '', '2015-06-12 00:33:04', '2015-06-12 00:33:04', '', 0, 'http://192.168.1.134/meridian/?post_type=spells&#038;p=705', 0, 'spells', '', 0),
(706, 1, '2015-05-23 02:18:01', '2015-05-23 02:18:01', 'Makes you indistinct, and unrecognizable to all but those who you''d like to know its you. Note that Shal''ille can not punish transgressors against you when you are anonymous. Requires rainbow ferns and firesand to cast.', 'Anonymity', '', 'publish', 'open', 'closed', '', 'anonymity', '', '', '2015-07-10 02:51:02', '2015-07-10 02:51:02', '', 0, 'http://192.168.1.134/meridian/?post_type=spells&#038;p=706', 0, 'spells', '', 0),
(707, 1, '2015-05-23 02:19:21', '2015-05-23 02:19:21', 'Teleports you to a central location in the room. Requires nothing but a will to move.', 'Blink', '', 'publish', 'open', 'closed', '', 'blink', '', '', '2015-07-10 02:51:17', '2015-07-10 02:51:17', '', 0, 'http://192.168.1.134/meridian/?post_type=spells&#038;p=707', 0, 'spells', '', 0),
(708, 1, '2015-05-23 02:20:34', '2015-05-23 02:20:34', 'Makes you appear to be deceased, that hopefully someone won''t really make you as such. Requires solagh and rainbow ferns to cast.', 'Feign Death', '', 'publish', 'open', 'closed', '', 'feign-death', '', '', '2015-07-10 02:51:29', '2015-07-10 02:51:29', '', 0, 'http://192.168.1.134/meridian/?post_type=spells&#038;p=708', 0, 'spells', '', 0),
(709, 1, '2015-05-23 02:21:42', '2015-05-23 02:21:42', 'Causes a bright flash, likely to interrupt the concentration of any spellcasters in the area or confuse monsters temporarily. Requires the eyes of a dragonfly to cast. Casting this spell can cause you to be labeled an outlaw.', 'Flash', '', 'publish', 'open', 'closed', '', 'flash', '', '', '2015-07-10 02:51:45', '2015-07-10 02:51:45', '', 0, 'http://192.168.1.134/meridian/?post_type=spells&#038;p=709', 0, 'spells', '', 0),
(710, 1, '2015-05-23 02:23:21', '2015-05-23 02:23:21', 'Transforms the target into a silhouette of their former self, perfect for skulking in darker locales and making them more difficult to hit. Requires a handful of rainbow fern.', 'Shadow Form', '', 'publish', 'open', 'closed', '', 'shadow-form', '', '', '2015-07-10 02:52:02', '2015-07-10 02:52:02', '', 0, 'http://192.168.1.134/meridian/?post_type=spells&#038;p=710', 0, 'spells', '', 0),
(711, 1, '2015-05-23 02:24:11', '2015-05-23 02:24:11', 'Makes you mighty appetizing to nearby monsters. The more powerful you are, the more likely you are to get the monster''s attention. Requires web moss and firesand to cast.', 'Bait', '', 'publish', 'open', 'closed', '', 'bait', '', '', '2015-07-10 02:52:15', '2015-07-10 02:52:15', '', 0, 'http://192.168.1.134/meridian/?post_type=spells&#038;p=711', 0, 'spells', '', 0),
(712, 1, '2015-05-23 02:25:15', '2015-05-23 02:25:15', 'Riija grants the ability to hear distant conversations, allowing you to spy on others. Requires dragonfly eyes.', 'Eavesdrop', '', 'publish', 'open', 'closed', '', 'eavesdrop', '', '', '2015-07-10 02:53:12', '2015-07-10 02:53:12', '', 0, 'http://192.168.1.134/meridian/?post_type=spells&#038;p=712', 0, 'spells', '', 0),
(713, 1, '2015-05-23 02:26:04', '2015-05-23 02:26:04', 'Reveals the knowledge of the victim, informing you of their abilities. Requires uncut seraphym to cast.', 'Foresight', '', 'publish', 'open', 'closed', '', 'foresight', '', '', '2015-07-10 02:53:44', '2015-07-10 02:53:44', '', 0, 'http://192.168.1.134/meridian/?post_type=spells&#038;p=713', 0, 'spells', '', 0),
(714, 1, '2015-05-23 02:27:39', '2015-05-23 02:27:39', 'Causes the victim to forget his or her own abilities. Requires firesand and uncut seraphym to cast. Casting this spell can cause you to be labeled an outlaw.', 'Forget', '', 'publish', 'open', 'closed', '', 'forget', '', '', '2015-07-10 02:53:54', '2015-07-10 02:53:54', '', 0, 'http://192.168.1.134/meridian/?post_type=spells&#038;p=714', 0, 'spells', '', 0),
(715, 1, '2015-05-23 02:28:37', '2015-05-23 02:28:37', 'Creates an illusionary wall of fire. This wall will cause illusionary wounds to victims walking through it. Requires rainbow ferns and firesand to cast.', 'Illusionary Firewall', '', 'publish', 'open', 'closed', '', 'illusionary-firewall', '', '', '2015-07-10 02:54:07', '2015-07-10 02:54:07', '', 0, 'http://192.168.1.134/meridian/?post_type=spells&#038;p=715', 0, 'spells', '', 0),
(716, 1, '2015-05-23 02:29:55', '2015-05-23 02:29:55', 'The touch of Riija shifts your appearance to another at random. Requires web moss and rainbow fern to cast.', 'Illusionary Form', '', 'publish', 'open', 'closed', '', 'illusionary-form', '', '', '2015-07-10 02:54:22', '2015-07-10 02:54:22', '', 0, 'http://192.168.1.134/meridian/?post_type=spells&#038;p=716', 0, 'spells', '', 0),
(717, 1, '2015-05-23 02:30:38', '2015-05-23 02:30:38', 'Causes the victim to see imagined wounds, but imagination always gives in to one''s right mind, assuming one lives so long. Requires solagh and firesand. Casting this spell can cause you to be labeled an outlaw.', 'Illusionary Wounds', '', 'publish', 'open', 'closed', '', 'illusionary-wounds', '', '', '2015-07-10 02:54:53', '2015-07-10 02:54:53', '', 0, 'http://192.168.1.134/meridian/?post_type=spells&#038;p=717', 0, 'spells', '', 0),
(718, 1, '2015-05-23 02:31:33', '2015-05-23 02:31:33', 'Summons a creature which mirrors your own appearance. Note that you are responsible for any of your reflections actions, and that they are notoriously hard to control. Requires firesand, rainbow ferns, and uncut seraphym to cast.', 'Reflection', '', 'publish', 'open', 'closed', '', 'reflection', '', '', '2015-06-12 01:00:14', '2015-06-12 01:00:14', '', 0, 'http://192.168.1.134/meridian/?post_type=spells&#038;p=718', 0, 'spells', '', 0),
(719, 1, '2015-05-23 02:32:23', '2015-05-23 02:32:23', 'This spell causes the victim to become so ill that they can hardly stand, much less fight. Requires dragonfly eyes and solagh. Casting this spell can cause you to be labeled an outlaw.', 'Vertigo', '', 'publish', 'open', 'closed', '', 'vertigo', '', '', '2015-07-10 02:57:07', '2015-07-10 02:57:07', '', 0, 'http://192.168.1.134/meridian/?post_type=spells&#038;p=719', 0, 'spells', '', 0),
(720, 1, '2015-05-23 02:33:21', '2015-05-23 02:33:21', 'Summons an illusory creature to attack your enemies. The creature does good damage, but is easily banished. Requires web moss and rainbow fern to cast. Casting this spell can cause you to be labeled an outlaw.', 'Apparition', '', 'publish', 'open', 'closed', '', 'apparition', '', '', '2015-07-10 02:57:21', '2015-07-10 02:57:21', '', 0, 'http://192.168.1.134/meridian/?post_type=spells&#038;p=720', 0, 'spells', '', 0),
(721, 1, '2015-05-23 02:34:09', '2015-05-23 02:34:09', 'Sends the mind of the target reeling with dark, bewildering thoughts, making spell casting more difficult for several minutes. Requires solagh and uncut seraphym to cast. Casting this spell can cause you to be labeled an outlaw.', 'Dement', '', 'publish', 'open', 'closed', '', 'dement', '', '', '2015-07-10 02:58:04', '2015-07-10 02:58:04', '', 0, 'http://192.168.1.134/meridian/?post_type=spells&#038;p=721', 0, 'spells', '', 0),
(722, 1, '2015-05-23 02:34:54', '2015-05-23 02:34:54', 'Causes the caster to unrealize their wounds, but beware when you realize its a hoax, because the wounds are still just as deep! Requires a firesand and solagh to cast.', 'Denial', '', 'publish', 'open', 'closed', '', 'denial', '', '', '2015-07-10 02:58:21', '2015-07-10 02:58:21', '', 0, 'http://192.168.1.134/meridian/?post_type=spells&#038;p=722', 0, 'spells', '', 0),
(724, 1, '2015-05-23 02:37:15', '2015-05-23 02:37:15', 'Briefly enchants an item with random powers. Unsuspecting buyers may overvalue the item. Requires firesand and uncut seraphym.', 'Artifice', '', 'publish', 'open', 'closed', '', 'artifice', '', '', '2015-07-10 02:59:01', '2015-07-10 02:59:01', '', 0, 'http://192.168.1.134/meridian/?post_type=spells&#038;p=724', 0, 'spells', '', 0),
(725, 1, '2015-05-23 02:38:22', '2015-05-23 02:38:22', 'Summons the darker side of the target, and will attack them. Note that you are responsible for any of your evil twins'' actions, and that they are notoriously hard to control.', 'Evil Twin', '', 'publish', 'open', 'closed', '', 'evil-twin', '', '', '2015-07-10 02:59:16', '2015-07-10 02:59:16', '', 0, 'http://192.168.1.134/meridian/?post_type=spells&#038;p=725', 0, 'spells', '', 0),
(726, 1, '2015-05-23 02:39:11', '2015-05-23 02:39:11', 'The touch of Riija shifts you into another beast! Requires web moss and dragonfly eyes to cast.', 'Morph', '', 'publish', 'open', 'closed', '', 'morph', '', '', '2015-07-10 02:59:29', '2015-07-10 02:59:29', '', 0, 'http://192.168.1.134/meridian/?post_type=spells&#038;p=726', 0, 'spells', '', 0),
(727, 1, '2015-05-23 02:40:05', '2015-05-23 02:40:05', 'Allows the caster to elude trouble and escape off to another location. A number of destinations may be available, and the caster must call out the name of the location he wishes to travel to. Requires a the claws of the fearsome kriipa to cast.', 'Elusion', '', 'publish', 'open', 'closed', '', 'elusion', '', '', '2015-07-10 02:59:42', '2015-07-10 02:59:42', '', 0, 'http://192.168.1.134/meridian/?post_type=spells&#038;p=727', 0, 'spells', '', 0),
