(734, 1, '2015-05-28 22:58:18', '2015-05-28 22:58:18', 'The great power of Shal''ille takes part of the caster''s life force and gives it to another person. Requires herbs to cast.', 'Breath of Life', '', 'publish', 'open', 'closed', '', 'breath-of-life', '', '', '2015-07-10 03:01:00', '2015-07-10 03:01:00', '', 0, 'http://192.168.1.134/meridian/?post_type=spells&#038;p=734', 0, 'spells', '', 0),
(735, 1, '2015-05-28 22:59:04', '2015-05-28 22:59:04', 'Allows you to see the vile defilers of her name. Requires a fairy wing to cast.', 'Detect Evil', '', 'publish', 'open', 'closed', '', 'detect-evil', '', '', '2015-07-10 03:01:11', '2015-07-10 03:01:11', '', 0, 'http://192.168.1.134/meridian/?post_type=spells&#038;p=735', 0, 'spells', '', 0),
(736, 1, '2015-05-28 22:59:40', '2015-05-28 22:59:40', 'This spell involves weaving your hands in a holy tracery which frightens nearby unholy beings. Requires elderberries to be crushed onto the skin of your hands to ritually cleanse them.', 'Holy Symbol', '', 'publish', 'open', 'closed', '', 'holy-symbol', '', '', '2015-07-10 03:01:26', '2015-07-10 03:01:26', '', 0, 'http://192.168.1.134/meridian/?post_type=spells&#038;p=736', 0, 'spells', '', 0),
(737, 1, '2015-05-28 23:00:16', '2015-05-28 23:00:16', 'The compassionate power of Shal''ille heals the wounds of the caster or another person. Shal''ille gives a small reward toward the karma of the mage who heals another good soul. Requires herbs to cast.', 'Minor Heal', '', 'publish', 'open', 'closed', '', 'minor-heal', '', '', '2015-07-10 03:01:46', '2015-07-10 03:01:46', '', 0, 'http://192.168.1.134/meridian/?post_type=spells&#038;p=737', 0, 'spells', '', 0),
(738, 1, '2015-05-28 23:01:00', '2015-05-28 23:01:00', 'Shal''ille''s magic reveals the location of the last person to slay an innocent. Requires herbs to cast.', 'Seance', '', 'publish', 'open', 'closed', '', 'seance', '', '', '2015-07-10 03:02:02', '2015-07-10 03:02:02', '', 0, 'http://192.168.1.134/meridian/?post_type=spells&#038;p=738', 0, 'spells', '', 0),
(739, 1, '2015-05-28 23:01:42', '2015-05-28 23:01:42', 'Pure, healing energy fights the effects of poison in the target. Requires herbs and elderberries to cast.', 'Cure Poison', '', 'publish', 'open', 'closed', '', 'cure-poison', '', '', '2015-07-10 03:03:15', '2015-07-10 03:03:15', '', 0, 'http://192.168.1.134/meridian/?post_type=spells&#038;p=739', 0, 'spells', '', 0),
(740, 1, '2015-05-28 23:02:17', '2015-05-28 23:02:17', 'Pure energy from Shal''ille sears your target. More effective on evil and undead targets. Requires emeralds.', 'Holy Touch', '', 'publish', 'open', 'closed', '', 'holy-touch', '', '', '2015-07-10 03:03:27', '2015-07-10 03:03:27', '', 0, 'http://192.168.1.134/meridian/?post_type=spells&#038;p=740', 0, 'spells', '', 0),
(741, 1, '2015-05-28 23:02:58', '2015-05-28 23:02:58', 'Dedicates your weapon to Shal''ille, enhancing its effectiveness against the unholy. Requires fairy wings and orc teeth to cast.', 'Holy Weapon', '', 'publish', 'open', 'closed', '', 'holy-weapon', '', '', '2015-07-10 03:03:40', '2015-07-10 03:03:40', '', 0, 'http://192.168.1.134/meridian/?post_type=spells&#038;p=741', 0, 'spells', '', 0),
(742, 1, '2015-05-28 23:03:27', '2015-05-28 23:03:27', 'Breaks the magical bond binding you to a cursed item. Requires emeralds to cast.', 'Remove Curse', '', 'publish', 'open', 'closed', '', 'remove-curse', '', '', '2015-07-10 03:03:53', '2015-07-10 03:03:53', '', 0, 'http://192.168.1.134/meridian/?post_type=spells&#038;p=742', 0, 'spells', '', 0),
(743, 1, '2015-05-28 23:04:02', '2015-05-28 23:04:02', 'Coats your body in a magical goo which absorbs damage from acid attacks for several minutes. Requires herbs and entroot berries.', 'Resist Acid', '', 'publish', 'open', 'closed', '', 'resist-acid', '', '', '2015-07-10 03:04:03', '2015-07-10 03:04:03', '', 0, 'http://192.168.1.134/meridian/?post_type=spells&#038;p=743', 0, 'spells', '', 0),
(744, 1, '2015-05-28 23:04:43', '2015-05-28 23:04:43', 'Pure, healing energy purges disease from the target. Requires herbs and elderberries to cast.', 'Cure Disease', '', 'publish', 'open', 'closed', '', 'cure-disease', '', '', '2015-07-10 03:04:47', '2015-07-10 03:04:47', '', 0, 'http://192.168.1.134/meridian/?post_type=spells&#038;p=744', 0, 'spells', '', 0),
(745, 1, '2015-05-28 23:05:22', '2015-05-28 23:05:22', 'Shal''ille is summoned to fortify the soul against unholy damage. Requires solagh and fairy wings to cast.', 'Holy Resolve', '', 'publish', 'open', 'closed', '', 'holy-resolve', '', '', '2015-07-10 03:05:00', '2015-07-10 03:05:00', '', 0, 'http://192.168.1.134/meridian/?post_type=spells&#038;p=745', 0, 'spells', '', 0),
(746, 1, '2015-05-28 23:05:52', '2015-05-28 23:05:52', 'Rejuvenates the target of the spell with Shal''ille''s healing energy. Shal''ille gives a small reward toward the karma of the mage who heals another good soul. Requires herbs to cast.', 'Hospice', '', 'publish', 'open', 'closed', '', 'hospice', '', '', '2015-07-10 03:05:16', '2015-07-10 03:05:16', '', 0, 'http://192.168.1.134/meridian/?post_type=spells&#038;p=746', 0, 'spells', '', 0),
(747, 1, '2015-05-28 23:06:24', '2015-05-28 23:06:24', 'Reveals any special properties of an item to the caster. Requires orc teeth to cast.', 'Identify', '', 'publish', 'open', 'closed', '', 'identify', '', '', '2015-07-10 03:05:29', '2015-07-10 03:05:29', '', 0, 'http://192.168.1.134/meridian/?post_type=spells&#038;p=747', 0, 'spells', '', 0),
(748, 1, '2015-05-28 23:07:03', '2015-05-28 23:07:03', 'Calls upon Shal''ille to transport you back to safety. Ability determines how fast you are rescued. Requires emerald to cast.', 'Rescue', '', 'publish', 'open', 'closed', '', 'rescue', '', '', '2015-07-10 03:05:51', '2015-07-10 03:05:51', '', 0, 'http://192.168.1.134/meridian/?post_type=spells&#038;p=748', 0, 'spells', '', 0),
(749, 1, '2015-05-28 23:08:01', '2015-05-28 23:08:01', 'Materializes a spiritual hammer. Requires emeralds and orc teeth to cast.', 'Spiritual Hammer', '', 'publish', 'open', 'closed', '', 'spiritual-hammer', '', '', '2015-06-12 01:46:21', '2015-06-12 01:46:21', '', 0, 'http://192.168.1.134/meridian/?post_type=spells&#038;p=749', 0, 'spells', '', 0),
(750, 1, '2015-05-28 23:08:41', '2015-05-28 23:08:41', 'Dazzles the target with the blinding light of Shal''ille''s goodness. Requires emeralds and purple mushrooms. Casting this spell can cause you to be labeled an outlaw.', 'Dazzle', '', 'publish', 'open', 'closed', '', 'dazzle', '', '', '2015-07-10 03:06:25', '2015-07-10 03:06:25', '', 0, 'http://192.168.1.134/meridian/?post_type=spells&#038;p=750', 0, 'spells', '', 0),
(751, 1, '2015-05-28 23:09:23', '2015-05-28 23:09:23', 'Summons Shal''ille to infuse her power into all good players in the room, making their attacks more accurate and her spells more potent. Requires elderberries and emeralds to cast.', 'Forces of Light', '', 'publish', 'open', 'closed', '', 'forces-of-light', '', '', '2015-07-10 03:06:37', '2015-07-10 03:06:37', '', 0, 'http://192.168.1.134/meridian/?post_type=spells&#038;p=751', 0, 'spells', '', 0),
(752, 1, '2015-05-28 23:09:59', '2015-05-28 23:09:59', 'Through Shal''ille''s intervention, the evil target suffers a loss of vigor. Requires emerald to cast. Casting this spell can cause you to be labeled an outlaw.', 'Mark of Dishonor', '', 'publish', 'open', 'closed', '', 'mark-of-dishonor', '', '', '2015-07-10 03:06:53', '2015-07-10 03:06:53', '', 0, 'http://192.168.1.134/meridian/?post_type=spells&#038;p=752', 0, 'spells', '', 0),
(753, 1, '2015-05-28 23:10:57', '2015-05-28 23:10:57', 'Removes harmful personal enchantments on the target. Requires emeralds and elderberries to cast.', 'Purify', '', 'publish', 'open', 'closed', '', 'purify', '', '', '2015-07-10 03:07:24', '2015-07-10 03:07:24', '', 0, 'http://192.168.1.134/meridian/?post_type=spells&#038;p=753', 0, 'spells', '', 0),
(754, 1, '2015-05-28 23:13:00', '2015-05-28 23:13:00', 'Permeates an area with the holy essence of Shal''ille, harming any who attempt to call on the evil energy of Qor. Requires yrxl sap and fairy wings to cast.', 'Qorbane', '', 'publish', 'open', 'closed', '', 'qorbane', '', '', '2015-07-10 03:07:36', '2015-07-10 03:07:36', '', 0, 'http://192.168.1.134/meridian/?post_type=spells&#038;p=754', 0, 'spells', '', 0),
(755, 1, '2015-05-28 23:13:53', '2015-05-28 23:13:53', 'The spirit of Shal''ille descends upon the area and calms the minds of all present, preventing combat for several minutes. Requires emerald and yrxl sap to cast.', 'Truce', '', 'publish', 'open', 'closed', '', 'truce', '', '', '2015-07-10 03:07:56', '2015-07-10 03:07:56', '', 0, 'http://192.168.1.134/meridian/?post_type=spells&#038;p=755', 0, 'spells', '', 0),
(756, 1, '2015-05-28 23:14:40', '2015-05-28 23:14:40', 'This is the lengthy formal ceremony performed at funerals to help the recently departed soul pass smoothly on to the Underworld. It may also be used to force nearby undead back in their graves where they belong. Requires emeralds and dried elderberries, which during the ceremony are crushed together into a symbolic handful of dust and scattered into the air. Casting this spell can cause you to be labeled an outlaw.', 'Final Rites', '', 'publish', 'open', 'closed', '', 'final-rites', '', '', '2015-07-10 03:08:14', '2015-07-10 03:08:14', '', 0, 'http://192.168.1.134/meridian/?post_type=spells&#038;p=756', 0, 'spells', '', 0),
(757, 1, '2015-05-28 23:15:13', '2015-05-28 23:15:13', 'The compassionate power of Shal''ille heals severe wounds in the caster or another player. Casting this powerful magic on evil souls will reduce your own karmic standing. Requires herbs to cast.', 'Major Heal', '', 'publish', 'open', 'closed', '', 'major-heal', '', '', '2015-06-12 01:28:58', '2015-06-12 01:28:58', '', 0, 'http://192.168.1.134/meridian/?post_type=spells&#038;p=757', 0, 'spells', '', 0),
(758, 1, '2015-05-28 23:15:49', '2015-05-28 23:15:49', 'Strips helpful personal enchantments off of the target. Requires emeralds and purple mushrooms to cast. Casting this spell can cause you to be labeled an outlaw.', 'Purge', '', 'publish', 'open', 'closed', '', 'purge', '', '', '2015-07-10 03:09:15', '2015-07-10 03:09:15', '', 0, 'http://192.168.1.134/meridian/?post_type=spells&#038;p=758', 0, 'spells', '', 0),
(759, 1, '2015-05-28 23:16:47', '2015-05-28 23:16:47', 'Strips away all hidden properties of an item, allowing anyone to see its special abilities. Requires a number of perfect orc teeth to cast.', 'Reveal', '', 'publish', 'open', 'closed', '', 'reveal', '', '', '2015-07-10 03:09:25', '2015-07-10 03:09:25', '', 0, 'http://192.168.1.134/meridian/?post_type=spells&#038;p=759', 0, 'spells', '', 0),
(760, 1, '2015-05-28 23:17:18', '2015-05-28 23:17:18', 'Creates a dome of magical energy that protects all players near the caster for several minutes. The spell dissipates if caster breaks concentration by running or combat. Requires emerald to cast.', 'Umbrella', '', 'publish', 'open', 'closed', '', 'umbrella', '', '', '2015-07-10 03:09:34', '2015-07-10 03:09:34', '', 0, 'http://192.168.1.134/meridian/?post_type=spells&#038;p=760', 0, 'spells', '', 0),
(761, 1, '2015-05-28 23:18:20', '2015-05-28 23:18:20', 'Infuses an item with a soft white light. However, the bond requires terrific amounts of energy to form. A Heartstone and dozens of polished serphym and diamonds must be crushed to amplify the caster''s mystical energy, which must then be focused through a prism. The item to be bonded must be targeted. Once the casting is complete the item will follow its owner to hell itself.', 'Bond', '', 'publish', 'open', 'closed', '', 'bond', '', '', '2015-06-12 01:44:30', '2015-06-12 01:44:30', '', 0, 'http://192.168.1.134/meridian/?post_type=spells&#038;p=761', 0, 'spells', '', 0),
(762, 1, '2015-05-28 23:21:24', '2015-05-28 23:21:24', 'Creates a portal for your fallen comrades to enter and return from the underworld back to their physical body. If formed in time the portal can lessen the shock of death. Requires emeralds and polished seraphym to cast.', 'Portal of Life', '', 'publish', 'open', 'closed', '', 'portal-of-life', '', '', '2015-06-12 01:45:05', '2015-06-12 01:45:05', '', 0, 'http://192.168.1.134/meridian/?post_type=spells&#038;p=762', 0, 'spells', '', 0),
(763, 1, '2015-05-28 23:22:47', '2015-05-28 23:22:47', 'Block is a basic skill, allowing people in combat to block blows with a shield. A successfully blocked blow will be more damaging to the attacking weapon and to the defending shield.', 'Block', '', 'publish', 'open', 'closed', '', 'block', '', '', '2015-07-10 03:11:22', '2015-07-10 03:11:22', '', 0, 'http://192.168.1.134/meridian/?post_type=spells&#038;p=763', 0, 'spells', '', 0),
(764, 1, '2015-05-28 23:25:38', '2015-05-28 23:25:38', 'Allows one to become more proficient at Meridian''s most common weapon.', 'Mace Fighting', '', 'publish', 'open', 'closed', '', 'mace-fighting', '', '', '2015-07-10 03:11:40', '2015-07-10 03:11:40', '', 0, 'http://192.168.1.134/meridian/?post_type=spells&#038;p=764', 0, 'spells', '', 0),
(765, 1, '2015-05-28 23:26:17', '2015-05-28 23:26:17', 'This is the most basic hand-to-hand combat move. Can be very strong for a powerful warrior, but is extremely tiring.', 'Punch', '', 'publish', 'open', 'closed', '', 'punch', '', '', '2015-07-10 03:11:51', '2015-07-10 03:11:51', '', 0, 'http://192.168.1.134/meridian/?post_type=spells&#038;p=765', 0, 'spells', '', 0),
(766, 1, '2015-05-28 23:27:17', '2015-05-28 23:27:17', 'Slash is the most common weapon skill. It helps you hit with melee weapons.', 'Slash', '', 'publish', 'open', 'closed', '', 'slash', '', '', '2015-07-10 03:12:06', '2015-07-10 03:12:06', '', 0, 'http://192.168.1.134/meridian/?post_type=spells&#038;p=766', 0, 'spells', '', 0),
