(1151, 1, '2015-06-30 23:45:16', '2015-06-30 23:45:16', 'This pewter and wood mug is roughly formed. A logo stamped onto its silver lip reads "Pietro''s Wicked Brew."', 'Mugs of Brew', '', 'publish', 'open', 'closed', '', 'mugs-of-brew', '', '', '2015-07-15 00:44:04', '2015-07-15 00:44:04', '', 0, 'http://192.168.1.134/meridian/?post_type=items&#038;p=1151', 0, 'items', '', 0),
(1152, 1, '2015-06-30 23:45:39', '2015-06-30 23:45:39', 'This leather skin contains cool, refreshing water drawn from the headwaters of the River Ille.', 'Water Skin', '', 'publish', 'open', 'closed', '', 'water-skin', '', '', '2015-07-15 00:49:17', '2015-07-15 00:49:17', '', 0, 'http://192.168.1.134/meridian/?post_type=items&#038;p=1152', 0, 'items', '', 0),
(1153, 1, '2015-06-30 23:47:13', '2015-06-30 23:47:13', 'This bright red apple, a favorite food of the country folk of Marion, is enormous and free of blemishes. It was probably grown in the deep forest of Farol.', 'Apple', '', 'publish', 'open', 'closed', '', 'apple', '', '', '2015-07-15 00:35:53', '2015-07-15 00:35:53', '', 0, 'http://192.168.1.134/meridian/?post_type=items&#038;p=1153', 0, 'items', '', 0),
(1154, 1, '2015-06-30 23:47:45', '2015-06-30 23:47:45', 'A steamy bowl of soup, with good chunky bits of mushroom and a blend of herbs.', 'Bowl of Soup', '', 'publish', 'open', 'closed', '', 'bowl-of-soup', '', '', '2015-07-15 00:36:52', '2015-07-15 00:36:52', '', 0, 'http://192.168.1.134/meridian/?post_type=items&#038;p=1154', 0, 'items', '', 0),
(1155, 1, '2015-06-30 23:48:09', '2015-06-30 23:48:09', 'Widow Qesino''s faroni stew has been heralded by some as a vegetarian classic. Full of healthy bits of deceased fungus beasts and living tree bark, you can only assume that this is an acquired taste.', 'Bowl of Stew', '', 'publish', 'open', 'closed', '', 'bowl-of-stew', '', '', '2015-07-15 00:37:27', '2015-07-15 00:37:27', '', 0, 'http://192.168.1.134/meridian/?post_type=items&#038;p=1155', 0, 'items', '', 0),
(1156, 1, '2015-06-30 23:49:01', '2015-06-30 23:49:01', 'Pietro''s secret recipes usually involve spicy wine grapes from the west. These particular grapes are extra plump and succulent.', 'Bunch of Grapes', '', 'publish', 'open', 'closed', '', 'bunch-of-grapes', '', '', '2015-07-15 00:37:52', '2015-07-15 00:37:52', '', 0, 'http://192.168.1.134/meridian/?post_type=items&#038;p=1156', 0, 'items', '', 0),
(1157, 1, '2015-06-30 23:51:50', '2015-06-30 23:51:50', 'A small block of imported Kocatani chocolate infused with a strain of mint which only grows in Faronath, this delicacy is purported to have certain magical properties in addition to its unquestionable appeal to the taste buds.', 'Chocolate Mint', '', 'publish', 'open', 'closed', '', 'chocolate-mint', '', '', '2015-07-15 00:38:27', '2015-07-15 00:38:27', '', 0, 'http://192.168.1.134/meridian/?post_type=items&#038;p=1157', 0, 'items', '', 0),
(1158, 1, '2015-06-30 23:53:43', '2015-06-30 23:53:43', 'The luscious leg of a large southern bird, covered lightly with some crunchy breadcrumbs and baked to a warm golden color.', 'Drum Stick', '', 'publish', 'open', 'closed', '', 'drum-stick', '', '', '2015-07-15 00:39:45', '2015-07-15 00:39:45', '', 0, 'http://192.168.1.134/meridian/?post_type=items&#038;p=1158', 0, 'items', '', 0),
(1159, 1, '2015-06-30 23:56:26', '2015-06-30 23:56:26', 'These large, brownish mushrooms are an edible cousin of the magical variety. They provide some sustenance although their nutritional value is questionable.', 'Edible Mushroom', '', 'publish', 'open', 'closed', '', 'edible-mushroom', '', '', '2015-07-15 00:39:51', '2015-07-15 00:39:51', '', 0, 'http://192.168.1.134/meridian/?post_type=items&#038;p=1159', 0, 'items', '', 0),
(1160, 1, '2015-06-30 23:57:01', '2015-06-30 23:57:01', 'The desire for a sweet future balances with the desire for a sweet cookie. Until you actually break the cookie and read your message, you will fulfill neither.', 'Fortune Cookie', '', 'publish', 'open', 'closed', '', 'fortune-cookie', '', '', '2015-07-15 00:40:40', '2015-07-15 00:40:40', '', 0, 'http://192.168.1.134/meridian/?post_type=items&#038;p=1160', 0, 'items', '', 0),
(1161, 1, '2015-06-30 23:57:26', '2015-06-30 23:57:26', 'At first glance, these mushrooms appear common, but look at those subtle stripes! These are actually Darken''s Invigorating Inky Caps!', 'Inky-Cap Mushroom', '', 'publish', 'open', 'closed', '', 'inky-cap-mushroom', '', '', '2015-07-15 00:41:27', '2015-07-15 00:41:27', '', 0, 'http://192.168.1.134/meridian/?post_type=items&#038;p=1161', 0, 'items', '', 0),
(1162, 1, '2015-06-30 23:57:59', '2015-06-30 23:57:59', 'This sweet smelling bread is a specialty of Tos although it can be found throughout the land. The baker is said to infuse the dough with magical elderberry, although none know for certain.', 'Loaf of Bread', '', 'publish', 'open', 'closed', '', 'loaf-of-bread', '', '', '2015-07-15 00:42:53', '2015-07-15 00:42:53', '', 0, 'http://192.168.1.134/meridian/?post_type=items&#038;p=1162', 0, 'items', '', 0),
(1163, 1, '2015-06-30 23:58:23', '2015-06-30 23:58:23', 'A golden brown crust tops this gigantic pie. It is filled with stewed troll meat and spices from far lands.', 'Meat Pie', '', 'publish', 'open', 'closed', '', 'meat-pie', '', '', '2015-07-15 00:43:19', '2015-07-15 00:43:19', '', 0, 'http://192.168.1.134/meridian/?post_type=items&#038;p=1163', 0, 'items', '', 0),
(1164, 1, '2015-06-30 23:58:45', '2015-06-30 23:58:45', 'A juicy slab of hamhock, slow roasted with a bit of apple glaze', 'Slice of Pork', '', 'publish', 'open', 'closed', '', 'slice-of-pork', '', '', '2015-07-15 00:46:53', '2015-07-15 00:46:53', '', 0, 'http://192.168.1.134/meridian/?post_type=items&#038;p=1164', 0, 'items', '', 0),
(1165, 1, '2015-07-01 00:00:11', '2015-07-01 00:00:11', 'Twice the size of an olive, and many times more tasty. The eye of a giant spider has been known as a delicacy, especially to the older residents of Marion.', 'Spider Eyes', '', 'publish', 'open', 'closed', '', 'spider-eyes', '', '', '2015-07-15 00:47:00', '2015-07-15 00:47:00', '', 0, 'http://192.168.1.134/meridian/?post_type=items&#038;p=1165', 0, 'items', '', 0),
(1166, 1, '2015-07-01 00:00:37', '2015-07-01 00:00:37', 'This is a scrumptious roasted turkey leg. The turkey is native to the jungles of Ko''catan and imported to the mainland by traders. Some people believe that the avars attack trading caravans to free the captured birds.', 'Turkey Leg', '', 'publish', 'open', 'closed', '', 'turkey-leg', '', '', '2015-07-15 00:48:35', '2015-07-15 00:48:35', '', 0, 'http://192.168.1.134/meridian/?post_type=items&#038;p=1166', 0, 'items', '', 0),
(1167, 1, '2015-07-01 00:01:03', '2015-07-01 00:01:03', 'This delicious cheese is made from the sweet milk of the pygmy cow. As the pygmy cow is rarely seen in Meridian proper, a cheese as fine as this is a delicacy indeed.', 'Wheel of Cheese', '', 'publish', 'open', 'closed', '', 'wheel-of-cheese', '', '', '2015-07-15 00:49:33', '2015-07-15 00:49:33', '', 0, 'http://192.168.1.134/meridian/?post_type=items&#038;p=1167', 0, 'items', '', 0),
(1168, 1, '2015-07-01 00:11:28', '2015-07-01 00:11:28', 'A crystalized form of raw mana, the energy for spells. Use this to regain the mana stored in this crystal. Since it is attuned to you, you cannot drop it or give it to anyone else.', 'Mana Crystal', '', 'publish', 'open', 'closed', '', 'mana-crystal', '', '', '2015-07-15 00:43:09', '2015-07-15 00:43:09', '', 0, 'http://192.168.1.134/meridian/?post_type=items&#038;p=1168', 0, 'items', '', 0),
(1170, 1, '2015-07-01 00:28:46', '0000-00-00 00:00:00', 'The lute is of a higher quality than most lutes. The instrument has been constructed flawlessly and the dark stain was obviously applied by a master craftsman. Its pine construction offers a richer sound than the more common rosewoods lutes.', 'Fine Lute', '', 'draft', 'open', 'closed', '', '', '', '', '2015-07-01 00:28:46', '2015-07-01 00:28:46', '', 0, 'http://192.168.1.134/meridian/?post_type=weapons&#038;p=1170', 0, 'weapons', '', 0),
(1171, 1, '2015-07-01 00:31:07', '2015-07-01 00:31:07', 'The lute is of a higher quality than most lutes. The instrument has been constructed flawlessly and the dark stain was obviously applied by a master craftsman. Its pine construction offers a richer sound than the more common rosewoods lutes.', 'Fine Lute', '', 'publish', 'open', 'closed', '', 'fine-lute', '', '', '2015-07-24 02:08:05', '2015-07-24 02:08:05', '', 0, 'http://192.168.1.134/meridian/?post_type=items&#038;p=1171', 0, 'items', '', 0),
(1172, 1, '2015-07-01 00:31:38', '2015-07-01 00:31:38', 'The simple lute is the instrument of choice among the meridian bards. It''s rosewood construction offers a deep, rich tone unmatched by any other instrument.', 'Lute', '', 'publish', 'open', 'closed', '', 'lute', '', '', '2015-07-24 02:08:20', '2015-07-24 02:08:20', '', 0, 'http://192.168.1.134/meridian/?post_type=items&#038;p=1172', 0, 'items', '', 0),
(1173, 1, '2015-07-01 00:32:27', '2015-07-01 00:32:27', 'This is the most perfect lute you have ever seen. It is rumored that Jala herself owned a lute that was identical to this one. It is made of a strange, dark, heavy wood and has a most beautiful sound. This lute surely gives more potence to the magical songs of the bard who plays it.', 'True Lute', '', 'publish', 'open', 'closed', '', 'true-lute', '', '', '2015-07-24 02:09:23', '2015-07-24 02:09:23', '', 0, 'http://192.168.1.134/meridian/?post_type=items&#038;p=1173', 0, 'items', '', 0),
(1174, 1, '2015-07-01 00:32:57', '2015-07-01 00:32:57', 'Finally! An adult-sized ant mask from Ko''catan. Now you can participate in the strange island ritual you''ve always heard about.', 'Ant Mask', '', 'publish', 'open', 'closed', '', 'ant-mask', '', '', '2015-07-24 02:07:17', '2015-07-24 02:07:17', '', 0, 'http://192.168.1.134/meridian/?post_type=items&#038;p=1174', 0, 'items', '', 0),
(1175, 1, '2015-07-01 00:33:12', '2015-07-01 00:33:12', 'A mask with the image of the fierce Kriipa. It doesn''t seem to make you jump any higher, however.', 'Kriipa Mask', '', 'publish', 'open', 'closed', '', 'kriipa-mask', '', '', '2015-07-24 02:08:15', '2015-07-24 02:08:15', '', 0, 'http://192.168.1.134/meridian/?post_type=items&#038;p=1175', 0, 'items', '', 0),
(1176, 1, '2015-07-01 00:33:38', '2015-07-01 00:33:38', 'A silly mask that looks like a rat''s head.', 'Rat Mask', '', 'publish', 'open', 'closed', '', 'rat-mask', '', '', '2015-07-24 02:08:25', '2015-07-24 02:08:25', '', 0, 'http://192.168.1.134/meridian/?post_type=items&#038;p=1176', 0, 'items', '', 0),
(1177, 1, '2015-07-01 00:33:54', '2015-07-01 00:33:54', 'An odd skull mask originally crafted in Ko''catan. It''s used to represent death in certain island ceremonies.', 'Skull Mask', '', 'publish', 'open', 'closed', '', 'skull-mask', '', '', '2015-07-24 02:09:08', '2015-07-24 02:09:08', '', 0, 'http://192.168.1.134/meridian/?post_type=items&#038;p=1177', 0, 'items', '', 0),
(1178, 1, '2015-07-01 00:34:14', '2015-07-01 00:34:14', 'A mask featuring the visage of a fierce troll! Use it to scare your friends.', 'Troll Mask', '', 'publish', 'open', 'closed', '', 'troll-mask', '', '', '2015-07-24 02:09:17', '2015-07-24 02:09:17', '', 0, 'http://192.168.1.134/meridian/?post_type=items&#038;p=1178', 0, 'items', '', 0),
(1179, 1, '2015-07-01 00:38:24', '2015-07-01 00:38:24', 'A thick leather cover binds this book, darkened with age and wear. It appears to come from some ancient time.', 'Book', '', 'publish', 'open', 'closed', '', 'book', '', '', '2015-07-15 00:36:19', '2015-07-15 00:36:19', '', 0, 'http://192.168.1.134/meridian/?post_type=items&#038;p=1179', 0, 'items', '', 0),
(1180, 1, '2015-07-01 00:38:45', '2015-07-01 00:38:45', 'Two players can use this board to play a game of chess. Anyone else can use the board to observe. The board must be on the ground for people to be able to play each other. If you pick up a board in the middle of a match, the board will save the status of the game so that it may be concluded later. To observe someone else''s game, just use the chessboard and you will join in as an observer. It is wise to find a safe area to play.', 'Chessboard', '', 'publish', 'open', 'closed', '', 'chessboard', '', '', '2015-07-15 00:38:20', '2015-07-15 00:38:20', '', 0, 'http://192.168.1.134/meridian/?post_type=items&#038;p=1180', 0, 'items', '', 0),
(1181, 1, '2015-07-01 00:39:05', '2015-07-01 00:39:05', 'This is a huge, unwieldy hunk of ugly, green rock, with strong, luminent veins suggesting immense hidden value inside.', 'Chunk of Nerudite', '', 'publish', 'open', 'closed', '', 'chunk-of-nerudite', '', '', '2015-07-15 00:38:35', '2015-07-15 00:38:35', '', 0, 'http://192.168.1.134/meridian/?post_type=items&#038;p=1181', 0, 'items', '', 0),
(1182, 1, '2015-07-01 00:39:22', '2015-07-01 00:39:22', 'This is a huge, unwieldly hunk of rock, with strong, silver veins suggesting immense hidden value inside.', 'Chunk of Ore', '', 'publish', 'open', 'closed', '', 'chunk-of-ore', '', '', '2015-07-15 00:38:57', '2015-07-15 00:38:57', '', 0, 'http://192.168.1.134/meridian/?post_type=items&#038;p=1182', 0, 'items', '', 0),
(1183, 1, '2015-07-01 00:39:49', '2015-07-01 00:39:49', 'This egg, the size of a large melon, has a tough, leathery covering. Some kind of liquid sloshes inside.', 'Egg', '', 'publish', 'open', 'closed', '', 'egg', '', '', '2015-07-15 00:39:58', '2015-07-15 00:39:58', '', 0, 'http://192.168.1.134/meridian/?post_type=items&#038;p=1183', 0, 'items', '', 0),
(1184, 1, '2015-07-01 00:40:19', '2015-07-01 00:40:19', 'This is a gift from the gods, to thank you for your patience and your patronage.', 'Gift', '', 'publish', 'open', 'closed', '', 'gift', '', '', '2015-07-15 00:40:49', '2015-07-15 00:40:49', '', 0, 'http://192.168.1.134/meridian/?post_type=items&#038;p=1184', 0, 'items', '', 0),
(1185, 1, '2015-07-01 00:40:38', '2015-07-01 00:40:38', 'Double-click this invitation when joining a guild to be accepted into their ranks.', 'Invitation', '', 'publish', 'open', 'closed', '', 'invitation', '', '', '2015-07-01 00:40:38', '2015-07-01 00:40:38', '', 0, 'http://192.168.1.134/meridian/?post_type=items&#038;p=1185', 0, 'items', '', 0),
(1186, 1, '2015-07-01 00:41:04', '2015-07-01 00:41:04', 'Nearly three times the weight of a human head, this mass of thick skull and oozing brains begins to attract flies. The stench alone disrupts any appetite you may have had.', 'Orc Pit Boss Head', '', 'publish', 'open', 'closed', '', 'orc-pit-boss-head', '', '', '2015-07-15 00:44:13', '2015-07-15 00:44:13', '', 0, 'http://192.168.1.134/meridian/?post_type=items&#038;p=1186', 0, 'items', '', 0),
(1187, 1, '2015-07-01 00:41:23', '2015-07-01 00:41:23', 'When held up to the light, this prism refracts a pretty rainbow of colors. If the legends of these magical items hold true, however, its true worth lies in its ability to focus the magical energies of multiple spellcasters for the casting of certain special spells. According to the mages of antiquity, a prism must be placed upon the ground before a spell may be focused through it. Once casting has begun, as many mages as the prism has sides may contribute to the energies stored within, and at least one mage must be casting at all times to keep the stored energy from dissipating. The spell being chanted will fire when enough magical power has been stored in the prism and there is exactly one caster for each side of the prism. This prism has three sides and glows extremely brightly.', 'Prism', '', 'publish', 'open', 'closed', '', 'prism', '', '', '2015-07-15 00:44:44', '2015-07-15 00:44:44', '', 0, 'http://192.168.1.134/meridian/?post_type=items&#038;p=1187', 0, 'items', '', 0),
(1188, 1, '2015-07-01 00:42:29', '2015-07-01 00:42:29', 'This object bears the markings of Qor. An inscription reads "The true servant shall bring this to the barren place and speak my name".', 'Relic of Qor', '', 'publish', 'open', 'closed', '', 'relic-of-qor', '', '', '2015-07-15 00:45:19', '2015-07-15 00:45:19', '', 0, 'http://192.168.1.134/meridian/?post_type=items&#038;p=1188', 0, 'items', '', 0),
(1189, 1, '2015-07-01 00:42:51', '2015-07-01 00:42:51', 'This is an official document of the Office of the Justicar. The Royal Justicar is the arbiter in disputes of Law in the Royal Eyes. Ye may cast thine vote for a candidate for the Office, if ye be a lawful citizen yourself, and thine candidate is also. Ye may only cast one vote each term of the Office. Only those votes received by the Caramo, the Assistant to the Justicar, are to be tallied.\r\n\r\n=[C]= Caramo, Assistant to the Royal Justicar', 'Royal Ballot', '', 'publish', 'open', 'closed', '', 'royal-ballot', '', '', '2015-07-15 00:45:32', '2015-07-15 00:45:32', '', 0, 'http://192.168.1.134/meridian/?post_type=items&#038;p=1189', 0, 'items', '', 0),
(1190, 1, '2015-07-01 00:43:25', '2015-07-01 00:43:25', 'This is an undamaged tail feather from an avar shaman. The strong barbs of the feather would make excellent guides for an arrow shaft.', 'Shaman Feather', '', 'publish', 'open', 'closed', '', 'shaman-feather', '', '', '2015-07-15 00:46:09', '2015-07-15 00:46:09', '', 0, 'http://192.168.1.134/meridian/?post_type=items&#038;p=1190', 0, 'items', '', 0),
(1191, 1, '2015-07-01 00:43:46', '2015-07-01 00:43:46', 'The currency of Meridian. A profile of an ancient princess adorns the front and an apothecary''s stone the back.', 'Shilling', '', 'publish', 'open', 'closed', '', 'shilling', '', '', '2015-07-15 00:46:15', '2015-07-15 00:46:15', '', 0, 'http://192.168.1.134/meridian/?post_type=items&#038;p=1191', 0, 'items', '', 0),
(1192, 1, '2015-07-01 00:45:19', '2015-07-01 00:45:19', 'There is something both grotesque and fascinating in staring at the mummified, distorted face on this reduced skull. What magic this object may hold, you haven''t a clue.', 'Shrunken Head', '', 'publish', 'open', 'closed', '', 'shrunken-head', '', '', '2015-07-24 02:09:03', '2015-07-24 02:09:03', '', 0, 'http://192.168.1.134/meridian/?post_type=items&#038;p=1192', 0, 'items', '', 0),
(1193, 1, '2015-07-01 00:45:34', '2015-07-01 00:45:34', 'A shaft of crudely hewn rough timber is topped by oily rags. When used it will provide limited illumination.', 'Torch', '', 'publish', 'open', 'closed', '', 'torch', '', '', '2015-07-24 02:09:13', '2015-07-24 02:09:13', '', 0, 'http://192.168.1.134/meridian/?post_type=items&#038;p=1193', 0, 'items', '', 0),
(1194, 1, '2015-07-01 00:45:57', '2015-07-01 00:45:57', 'One whiff of this musky-scented fluid is enough to give you a warm, fuzzy feeling.', 'Vial of Perfume', '', 'publish', 'open', 'closed', '', 'vial-of-perfume', '', '', '2015-07-01 00:45:57', '2015-07-01 00:45:57', '', 0, 'http://192.168.1.134/meridian/?post_type=items&#038;p=1194', 0, 'items', '', 0),
(1195, 1, '2015-07-01 00:46:22', '2015-07-01 00:46:22', 'This small vial is filled with crystalized fluid. A quick taste reveals the contents to be no more than sugar water.', 'Vial of Saccaqua', '', 'publish', 'open', 'closed', '', 'vial-of-saccaqua', '', '', '2015-07-01 00:46:22', '2015-07-01 00:46:22', '', 0, 'http://192.168.1.134/meridian/?post_type=items&#038;p=1195', 0, 'items', '', 0),
(1196, 1, '2015-07-01 00:46:43', '2015-07-01 00:46:43', 'Thought to be an artifact from the Empire of the Nexus before this land was even discovered, this ancient shield is too old and valuable to be used in combat.\r\n\r\nBeing one of a kind, this shield can not be carried in one''s possession for very long or tucked away in a chest.', 'Ancient Shield', '', 'publish', 'open', 'closed', '', 'ancient-shield', '', '', '2015-07-15 00:35:35', '2015-07-15 00:35:35', '', 0, 'http://192.168.1.134/meridian/?post_type=items&#038;p=1196', 0, 'items', '', 0),
(1197, 1, '2015-07-01 00:46:57', '2015-07-01 00:46:57', 'Excavated during the construction of the palace of the dark Princess Venya''cyr, the Urn came quickly into her possession as a valued treasure. Ancient rumors suggest the Urn is cursed. The craftsmanship of this priceless relic comes from unknown origins, certainly predating the Meridian settlers. An unusual presence prevents this object from being stored in a chest or held for very long.', 'Gold Urn', '', 'publish', 'open', 'closed', '', 'gold-urn', '', '', '2015-07-15 00:41:20', '2015-07-15 00:41:20', '', 0, 'http://192.168.1.134/meridian/?post_type=items&#038;p=1197', 0, 'items', '', 0),
(1198, 1, '2015-07-01 00:47:18', '2015-07-01 00:47:18', 'Antiquarians claim there only to be a few of the priceless Minjaka Vases left in existence. These exquisitely mastered vases use to line the throne room of Castle Victoria during the Minjakan dynasty of explorers in the second century.\r\n\r\nBeing one of a kind, this vase can not be carried in one''s possession for very long or tucked away in a chest.', 'Minjaka Vase', '', 'publish', 'open', 'closed', '', 'minjaka-vase', '', '', '2015-07-15 00:43:28', '2015-07-15 00:43:28', '', 0, 'http://192.168.1.134/meridian/?post_type=items&#038;p=1198', 0, 'items', '', 0),
(1199, 1, '2015-07-01 00:47:49', '2015-07-01 00:47:49', 'This decorative piece of art was created for King Zarcos the 4th to be given to his wife on their wedding day. Later, when Queen Joline was convicted of treason and exiled, the king ordered the heirloom destroyed because it reminded him of her. Apparently, the orders were not completely carried out.\r\n\r\nBeing one of a kind, this heirloom can not be carried in one''s possession for very long or tucked away in a chest.', 'Priceless Heirloom of Barloque', '', 'publish', 'open', 'closed', '', 'priceless-heirloom-of-barloque', '', '', '2015-07-15 00:44:34', '2015-07-15 00:44:34', '', 0, 'http://192.168.1.134/meridian/?post_type=items&#038;p=1199', 0, 'items', '', 0),
(1200, 1, '2015-07-01 00:48:49', '2015-07-01 00:48:49', 'Fabricated in the 5th century, this one of a kind heirloom was meant to be delivered as a gift to the Emperor of the old land. Before the couriers could set out, the Nexus snapped, destroying any possible route to the empire. The Chalice was lost for centuries, thought to be absconded with by thieves.\r\n\r\nBeing one of a kind, this Chalice can not be carried in one''s possession for very long or tucked away in a chest.', 'The Emperor''s Chalice', '', 'publish', 'open', 'closed', '', 'the-emperors-chalice', '', '', '2015-07-15 00:47:27', '2015-07-15 00:47:27', '', 0, 'http://192.168.1.134/meridian/?post_type=items&#038;p=1200', 0, 'items', '', 0),
(1201, 1, '2015-07-01 00:49:08', '2015-07-01 00:49:08', 'This feathered totem is often the objective of quests set upon mortals by the Bards of the world of Meridian.\r\n\r\nThe totem must be held when in possession, and is dropped when removed from use.', 'Totem', '', 'publish', 'open', 'closed', '', 'totem', '', '', '2015-07-15 00:47:46', '2015-07-15 00:47:46', '', 0, 'http://192.168.1.134/meridian/?post_type=items&#038;p=1201', 0, 'items', '', 0),
(1202, 1, '2015-07-01 00:49:27', '2015-07-01 00:49:27', 'This bottle of liquid holds some ominous purpose you can only guess at.', 'Blood of the Innocent', '', 'publish', 'open', 'closed', '', 'blood-of-the-innocent', '', '', '2015-07-15 00:36:09', '2015-07-15 00:36:09', '', 0, 'http://192.168.1.134/meridian/?post_type=items&#038;p=1202', 0, 'items', '', 0),
