(1207, 1, '2015-07-01 00:51:28', '2015-07-01 00:51:28', 'This ornate chalice is adorned with holy markings of Shal''ille. An inscription reads "to catch her tears."', 'Chalice of Rain', '', 'publish', 'open', 'closed', '', 'chalice-of-rain', '', '', '2015-07-15 00:38:13', '2015-07-15 00:38:13', '', 0, 'http://192.168.1.134/meridian/?post_type=items&#038;p=1207', 0, 'items', '', 0),
(1208, 1, '2015-07-01 00:52:07', '2015-07-01 00:52:07', 'This gem was created by the great alchemist, Froz, in a secret process known only to him. Rumor has it that it is a conduit for mystical aggression. Your hand tingles when you hold it.', 'Jewel of Froz', '', 'publish', 'open', 'closed', '', 'jewel-of-froz', '', '', '2015-07-24 02:08:10', '2015-07-24 02:08:10', '', 0, 'http://192.168.1.134/meridian/?post_type=items&#038;p=1208', 0, 'items', '', 0),
