(1280, 1, '2015-07-24 02:05:59', '2015-07-24 02:05:59', '<p>Thought to be an artifact from the Empire of the Nexus before this land was even discovered, this ancient shield is too old and valuable to be used in combat.</p>\n<p>Being one of a kind, this shield can not be carried in one''s possession for very long or tucked away in a chest.</p>\n', 'Ancient Shield', '', 'inherit', 'open', 'closed', '', '1196-autosave-v1', '', '', '2015-07-24 02:05:59', '2015-07-24 02:05:59', '', 1196, 'http://192.168.1.134/meridian/1196-autosave-v1/', 0, 'revision', '', 0);
